b\",\"descripcion\":\"<h2>What is Lorem Ipsum?<\\/h2>\\r\\n\\r\\n<p><strong>Lorem Ipsum<\\/strong>&nbsp;is simply dummy text of the printing and typesetting industry. Lorem Ipsum has been the industry&#39;s standard dummy text ever since the 1500s, when an unknown printer took a galley of type and scrambled it to make a type specimen book. It has survived not only five centuries, but also the leap into electronic typesetting, remaining essentially unchanged. It was popularised in the 1960s with the release of Letraset sheets containing Lorem Ipsum passages, and more recently with desktop publishing software like Aldus PageMaker including versions of Lorem Ipsum.<\\/p>\\r\\n\\r\\n<h2>Why do we use it?<\\/h2>\\r\\n\\r\\n<p>It is a long established fact that a reader will be distracted by the readable content of a page when looking at its layout. The point of using Lorem Ipsum is that it has a more-or-less normal distribution of letters, as opposed to using &#39;Content here, content here&#39;, making it look like readable English. Many desktop publishing packages and web page editors now use Lorem Ipsum as their default model text, and a search for &#39;lorem ipsum&#39; will uncover many web sites still in their infancy. Various versions have evolved over the years, sometimes by accident, sometimes on purpose (injected humour and the like).<\\/p>\\r\\n\\r\\n<p>&nbsp;<\\/p>\\r\\n\\r\\n<h2>Where does it come from?<\\/h2>\",\"_token\":\"dUwJgaKNZmdNR1R5LO571lUbgxPHFNlGDr5CAmpt\"}','2019-08-20 19:39:19','2019-08-20 19:39:19'),(7343,1,'admin/noticias','GET','190.146.249.12','[]','2019-08-20 19:39:20','2019-08-20 19:39:20'),(7344,1,'admin/noticias','GET','190.146.249.12','[]','2019-08-20 19:40:17','2019-08-20 19:40:17'),(7345,1,'admin/noticias','GET','190.146.249.12','[]','2019-08-20 19:40:27','2019-08-20 19:40:27'),(7346,1,'admin/noticias/1/edit','GET','190.146.249.12','{\"_pjax\":\"#pjax-container\"}','2019-08-20 19:40:31','2019-08-20 19:40:31'),(7347,2,'admin','GET','186.31.137.182','[]','2019-08-20 19:55:00','2019-08-20 19:55:00'),(7348,2,'admin/inmuebles','GET','186.31.137.182','[]','2019-08-20 19:55:01','2019-08-20 19:55:01'),(7349,2,'admin/politicas','GET','186.31.137.182','{\"_pjax\":\"#pjax-container\"}','2019-08-20 19:55:30','2019-08-20 19:55:30'),(7350,2,'admin/politicas/1/edit','GET','186.31.137.182','{\"_pjax\":\"#pjax-container\"}','2019-08-20 19:55:34','2019-08-20 19:55:34'),(7351,2,'admin/politicas/1','PUT','186.31.137.182','{\"texto\":\"<p><strong>POL&Iacute;TICA DE TRATAMIENTO DE INFORMACI&Oacute;N<\\/strong><\\/p>\\r\\n\\r\\n<p>&nbsp;<\\/p>\\r\\n\\r\\n<p><strong>GRUPO SYS S.A.S<\\/strong><\\/p>\\r\\n\\r\\n<p>&nbsp;<\\/p>\\r\\n\\r\\n<p>Con miras a proteger y asegurar a los titulares de datos personales un debido tratamiento de su informaci&oacute;n, y en observancia a la Ley 1581 de 2012 y al Decreto 1377 de 2013, <strong>GRUPO SYS S.A.S., <\\/strong>(en adelante GRUPO SYS S.A.S) expide las siguientes directrices en el tratamiento de Datos Personales:<\\/p>\\r\\n\\r\\n<p>&nbsp;<\\/p>\\r\\n\\r\\n<ol>\\r\\n\\t<li><strong>IDENTIFICACI&Oacute;N DEL RESPONSABLE DEL TRATAMIENTO DE DATOS PERSONALES<\\/strong><\\/li>\\r\\n<\\/ol>\\r\\n\\r\\n<p>&nbsp;<\\/p>\\r\\n\\r\\n<p><strong>GRUPO SYS S.A.S.<\\/strong>, como responsable del tratamiento de datos personales, es una sociedad inscrita en la C&aacute;mara de Comercio de Bogot&aacute; bajo el n&uacute;mero de matr&iacute;cula mercantil 3001185 del 21 de agosto de 2018, identificada con NIT. 901206464 - 8. Su direcci&oacute;n comercial es Calle 123 No. 9C - 45 AP 503 de la ciudad de Bogot&aacute; D.C, tel&eacute;fono 313 5480469 y correo electr&oacute;nico <a href=\\\"mailto:giraldosebastian55@gmail.com\\\">giraldosebastian55@gmail.com<\\/a><\\/p>\\r\\n\\r\\n<p>&nbsp;<\\/p>\\r\\n\\r\\n<p><strong>GRUPO SYS S.A.S.<\\/strong>, es una plataforma dise&ntilde;ada para sistemas Android y IOS, con el fin que personas naturales encuentren inmuebles para comprar o arrendar de conformidad a la oferta de los suscriptores de la plataforma (Constructoras, agentes inmobiliarios, inmobiliarias y personas naturales). Con el fin de cumplir con el objeto de la plataforma cada una de las partes deber&aacute; suministrar su informaci&oacute;n de personal, as&iacute; como su informaci&oacute;n de contacto para poder establecer comunicaci&oacute;n entre las partes y suplir las necesidades de los usuarios.<\\/p>\\r\\n\\r\\n<p>&nbsp;<\\/p>\\r\\n\\r\\n<p>Todos los datos personales que se recolectan y almacenan son entregados de forma voluntaria por parte del titular, y se presume que son ver&iacute;dicos y son propios de quien accede a la plataforma.<\\/p>\\r\\n\\r\\n<p>&nbsp;<\\/p>\\r\\n\\r\\n<p>Esta Pol&iacute;tica de Protecci&oacute;n de Datos Personales se aplicar&aacute; a todas las Bases de Datos y\\/o Archivos que contengan Datos Personales que sean objeto de Tratamiento por parte de <strong>GRUPO SYS S.A.S<\\/strong> considerada como responsable y\\/o encargada del tratamiento de Datos Personales.<\\/p>\\r\\n\\r\\n<p>&nbsp;<\\/p>\\r\\n\\r\\n<p>La cobertura de estas pol&iacute;ticas cobija a todos los clientes personas naturales, proveedores de <strong>GRUPO SYS S.A.S<\\/strong>, as&iacute; como a los potenciales clientes con quienes la sociedad mantiene comunicaci&oacute;n.<\\/p>\\r\\n\\r\\n<p>&nbsp;<\\/p>\\r\\n\\r\\n<p>Dentro de <strong>GRUPO SYS S.A.S<\\/strong> NO hay tratamiento (recolecci&oacute;n, almacenamiento, uso, circulaci&oacute;n o supresi&oacute;n) de datos sensibles de los titulares de los datos personales.<\\/p>\\r\\n\\r\\n<p>&nbsp;<\\/p>\\r\\n\\r\\n<ol>\\r\\n\\t<li><strong>CONCEPTOS GENERALES<\\/strong><\\/li>\\r\\n<\\/ol>\\r\\n\\r\\n<p>Con el fin de dar una mayor claridad a los usuarios e interesados, a continuaci&oacute;n, se hace un listado de los conceptos generales a tener en cuenta en materia de Habeas Data, de conformidad con la legislaci&oacute;n nacional:<\\/p>\\r\\n\\r\\n<p>&nbsp;<\\/p>\\r\\n\\r\\n<ol>\\r\\n\\t<li><strong>Dato privado:<\\/strong> aquella informaci&oacute;n de car&aacute;cter personal que por su naturaleza &iacute;ntima o reservada s&oacute;lo es relevante para el Titular.<\\/li>\\r\\n\\t<li><strong>Dato semiprivado: <\\/strong>el dato que no tiene naturaleza &iacute;ntima, reservada, ni p&uacute;blica y cuyo conocimiento o divulgaci&oacute;n puede interesar no s&oacute;lo a su Titular sino a cierto sector o grupo de personas o a la sociedad en general. Ejemplo, el dato financiero para el caso de una entidad evaluadora de riesgos financieros.<\\/li>\\r\\n\\t<li><strong>Dato p&uacute;blico:<\\/strong> aquella informaci&oacute;n del titular que es calificada como &ldquo;P&uacute;blica&rdquo; por la Ley o la Constituci&oacute;n Pol&iacute;tica. Adicionalmente se consideran como datos p&uacute;blicos todos aquellos que no sean semiprivados o privados, de conformidad con la Ley 1266 de 2008. Ejemplo, los datos contenidos en documentos p&uacute;blicos, sentencias judiciales debidamente ejecutoriadas que no est&eacute;n sometidos a reserva y los relativos al estado civil de las personas.<\\/li>\\r\\n\\t<li><strong>Datos sensibles:<\\/strong> Se trata de la informaci&oacute;n personal que afecta la intimidad del Titular o cuyo uso indebido puede generar su discriminaci&oacute;n. Los datos sensibles son aquellos que revelen el origen racial o &eacute;tnico, la orientaci&oacute;n pol&iacute;tica, las convicciones religiosas o filos&oacute;ficas, la pertenencia a sindicatos, organizaciones sociales, de derechos humanos o que promuevan intereses de cualquier partido pol&iacute;tico o que garanticen los derechos y garant&iacute;as de partidos pol&iacute;ticos de oposici&oacute;n, as&iacute; como los datos relativos a la salud, a la vida sexual y los datos biom&eacute;tricos.<\\/li>\\r\\n\\t<li><strong>Responsable de Tratamiento: <\\/strong>Es la persona natural o jur&iacute;dica, p&uacute;blica o privada, que por s&iacute; misma o en asocio con otros, decida sobre el Tratamiento de los datos.<\\/li>\\r\\n\\t<li><strong>Encargado del Tratamiento: <\\/strong>Es la persona natural o jur&iacute;dica, p&uacute;blica o privada, que por s&iacute; misma o en asocio con otros, realice el Tratamiento de datos personales por cuenta del Responsable del Tratamiento.<\\/li>\\r\\n<\\/ol>\\r\\n\\r\\n<ol>\\r\\n\\t<li><strong>TITULARES DE DATOS PERSONALES<\\/strong><\\/li>\\r\\n<\\/ol>\\r\\n\\r\\n<p>&nbsp;<\\/p>\\r\\n\\r\\n<p>De acuerdo a la Ley 1581 de 2012 se entiende por titulares de datos personales, la &ldquo;<em>Persona natural cuyos datos personales sean objeto de Tratamiento&rdquo;, <\\/em>sin embargo, las personas jur&iacute;dicas, cliente de la sociedad GRUPO SYS S.A.S., entregan informaci&oacute;n personal de sus empleados y por lo tanto se extiende el alcance de la pol&iacute;tica de tratamiento a todas las personas jur&iacute;dicas que sean sus clientes y que usen el servicio de la plataforma e incluyan datos personales de personas naturales (empleados) en las de bases de datos de GRUPO SYS S.A.S.<\\/p>\\r\\n\\r\\n<p>&nbsp;<\\/p>\\r\\n\\r\\n<ol>\\r\\n\\t<li><strong>PRIVACIDAD DE LOS TITULARES DE DATOS PERSONALES<\\/strong><\\/li>\\r\\n<\\/ol>\\r\\n\\r\\n<p><strong>GRUPO SYS S.A.S.<\\/strong>, respeta la privacidad de todos y cada uno de los terceros que le suministren sus datos personales por medio de los diferentes medios de recolecci&oacute;n y captura de dicha informaci&oacute;n dispuestos para tal efecto.<strong> GRUPO SYS S.A.S <\\/strong>recibe la mencionada informaci&oacute;n, la almacena de forma adecuada y segura con los m&eacute;todos tecnol&oacute;gicos id&oacute;neos para evitar que terceros sin autorizaci&oacute;n accedan a dicha informaci&oacute;n y de tal forma asegurando la confidencialidad de la informaci&oacute;n suministrada por el titular del dato personal.<\\/p>\\r\\n\\r\\n<p>&nbsp;<\\/p>\\r\\n\\r\\n<p><strong>GRUPO SYS S.A.S <\\/strong>almacenar&aacute; de manera segura la informaci&oacute;n recolectada, por lo tanto, tomar&aacute; todas las medidas de precauci&oacute;n para proteger su informaci&oacute;n contra p&eacute;rdida, abuso, alteraci&oacute;n, acceso o uso no autorizado o fraudulento.<\\/p>\\r\\n\\r\\n<p><strong>GRUPO SYS S.A.S, <\\/strong>no se responsabiliza por cualquier consecuencia derivada del ingreso indebido de terceros a la base de datos ni por alguna falla t&eacute;cnica en el funcionamiento y\\/o conservaci&oacute;n de datos en el sistema de almacenamiento de la informaci&oacute;n, por causas que no le sean imputables, tales como<\\/p>\\r\\n\\r\\n<ul>\\r\\n\\t<li>Suministro de contrase&ntilde;as a terceros<\\/li>\\r\\n\\t<li>Acceso al aplicativo por plataformas no seguras<\\/li>\\r\\n\\t<li>Suministro de informaci&oacute;n bancaria a terceros<\\/li>\\r\\n<\\/ul>\\r\\n\\r\\n<p>Las contrase&ntilde;as escogidas por los usuarios son personales e intransferibles; cada usuario se compromete a mantener la custodia secreta de tales contrase&ntilde;as.<\\/p>\\r\\n\\r\\n<ol>\\r\\n\\t<li><strong>DATOS PERSONALES SUSCEPTIBLES DE TRATAMIENTO<\\/strong><\\/li>\\r\\n<\\/ol>\\r\\n\\r\\n<p>Los datos personales susceptibles de tratamiento por parte de la sociedad <strong>GRUPO SYS S.A.S <\\/strong>son los siguientes:<\\/p>\\r\\n\\r\\n<p><strong>Clientes:<\\/strong> cuando son personas naturales que ofrecen un inmueble para arrendar o vender deben suministrar su nombre, identificaci&oacute;n, direcci&oacute;n del inmueble, numero de contacto, correo electr&oacute;nico. Cuando el cliente es persona jur&iacute;dica suministra la informaci&oacute;n de la sociedad, no obstante, dicha informaci&oacute;n puede incluir datos personales de sus empleados.<\\/p>\\r\\n\\r\\n<p><strong>Usuarios personas naturales:<\\/strong> nombres, documentos de identidad, domicilio, tel&eacute;fono de contacto, correo electr&oacute;nico de contacto.<\\/p>\\r\\n\\r\\n<p><strong>Empleados: <\\/strong>nombre, identificaci&oacute;n, tel&eacute;fono, direcci&oacute;n, cuenta bancaria, tipo de sangre.<\\/p>\\r\\n\\r\\n<ol>\\r\\n\\t<li><strong>TRATAMIENTO Y FINALIDAD<\\/strong><\\/li>\\r\\n<\\/ol>\\r\\n\\r\\n<p>De acuerdo a la Ley 1581 de 2012 se entiende por <em>&lsquo;Tratamiento De Datos Personales&rsquo;<\\/em>, cualquier operaci&oacute;n o conjunto de operaciones sobre datos personales, tales como la recolecci&oacute;n, almacenamiento, uso, circulaci&oacute;n o supresi&oacute;n de ellos. GRUPO SYS S.A.S podr&aacute; recolectar informaci&oacute;n de sus clientes, usuarios y\\/o de cualquier otra persona con la cual tenga, o pueda llegar a tener relaci&oacute;n civil y\\/o comercial, as&iacute; mismo podr&aacute; tratar la informaci&oacute;n por todo el tiempo en que se justifique la finalidad del tratamiento.<\\/p>\\r\\n\\r\\n<p>&nbsp;<\\/p>\\r\\n\\r\\n<p><strong>GRUPO SYS S.A.S <\\/strong>utiliza esta informaci&oacute;n para los siguientes prop&oacute;sitos:<\\/p>\\r\\n\\r\\n<p>&nbsp;<\\/p>\\r\\n\\r\\n<p>Clientes:<\\/p>\\r\\n\\r\\n<p>&nbsp;<\\/p>\\r\\n\\r\\n<ol>\\r\\n\\t<li>El registro y validaci&oacute;n de Clientes<\\/li>\\r\\n\\t<li>Administrar las cuentas de los Clientes<\\/li>\\r\\n\\t<li>Permitir el acceso y salida de los clientes de sus cuentas<\\/li>\\r\\n\\t<li>Puedan ofrecer sus inmuebles en el mercado mediante el uso de la plataforma.<\\/li>\\r\\n\\t<li>Puedan contactarse de forma directa con el usuario interesado en el inmueble y poder realizar visitas y concretar un negocio.<\\/li>\\r\\n\\t<li>Facturaci&oacute;n<\\/li>\\r\\n\\t<li>Permitir pautar piezas o informaci&oacute;n publicitaria<\\/li>\\r\\n\\t<li>Para programar las citas con los lo empleados del GRUPO SYS SAS y cumplir con las finalidades del contrato (fotograf&iacute;as y videos del inmueble)<\\/li>\\r\\n\\t<li>Para recibir la informaci&oacute;n comercial y\\/o publicitaria relacionada con la plataforma<\\/li>\\r\\n\\t<li>Enviar informaci&oacute;n comercial relacionada con el portal<\\/li>\\r\\n<\\/ol>\\r\\n\\r\\n<p>&nbsp;<\\/p>\\r\\n\\r\\n<p>Usuarios<\\/p>\\r\\n\\r\\n<p>&nbsp;<\\/p>\\r\\n\\r\\n<ol>\\r\\n\\t<li>El registro y validaci&oacute;n de los usuarios<\\/li>\\r\\n\\t<li>Administrar las cuentas de los usuarios<\\/li>\\r\\n\\t<li>Permitir el acceso y salida de los usuarios de sus cuentas<\\/li>\\r\\n\\t<li>Poderse contactar de forma directa con el due&ntilde;o del inmueble se esta interesado en obtener o arrendar<\\/li>\\r\\n\\t<li>Env&iacute;o de posibles inmuebles que sean de su inter&eacute;s de conformidad con las caracter&iacute;sticas enlistadas en el momento de la inscripci&oacute;n<\\/li>\\r\\n\\t<li>Env&iacute;o de oferta e invitaciones v&iacute;a correo electr&oacute;nico y mensaje de texto que sean de su inter&eacute;s.<\\/li>\\r\\n\\t<li>Enviar informaci&oacute;n comercial relacionada con el portal<\\/li>\\r\\n\\t<li>Ceder los datos de car&aacute;cter personal a terceras personas naturales o jur&iacute;dicas, civiles o comerciales, quienes a su vez sean clientes de GRUPO SYS S.A.S., y con quienes se deba contactar con el fin de alcanzar los fines propios de los servicios que presta la plataforma tales como, pero sin limitarse a ellos, el contacto entre comprador y vendedor, el contacto entre arrendador y arrendatario, contacto entre clientes e intermediaros comerciales interesados en ofrecer productos o servicios relacionados con la informaci&oacute;n entregada por cada cliente, tales como agencias o intermediarios inmobiliarios.<\\/li>\\r\\n<\\/ol>\\r\\n\\r\\n<p>&nbsp;<\\/p>\\r\\n\\r\\n<p>Empleados<\\/p>\\r\\n\\r\\n<p>&nbsp;<\\/p>\\r\\n\\r\\n<ol>\\r\\n\\t<li>Cumplir las finalidades de un contrato de car&aacute;cter laboral<\\/li>\\r\\n\\t<li>Poder realizar los pagos a las cuentas indicadas, de conformidad a la ley<\\/li>\\r\\n\\t<li>Informar a los clientes quien ser&aacute; la persona que va a tomar las fotos y videos de los inmuebles.<\\/li>\\r\\n<\\/ol>\\r\\n\\r\\n<p>&nbsp;<\\/p>\\r\\n\\r\\n<ol>\\r\\n\\t<li><strong>TRATAMIENTO DE DATOS SENSIBLES<\\/strong><\\/li>\\r\\n<\\/ol>\\r\\n\\r\\n<p>&nbsp;<\\/p>\\r\\n\\r\\n<p>De acuerdo al art&iacute;culo 3 numeral 3 del Decreto 1377 de 2013, se entiende por <em>Datos Sensibles<\\/em> aquellos que afectan la intimidad del Titular o cuyo uso indebido puede generar su discriminaci&oacute;n, tales como aquellos que revelen el origen racial o &eacute;tnico, la orientaci&oacute;n pol&iacute;tica, las convicciones religiosas o filos&oacute;ficas, la pertenencia a sindicatos, organizaciones sociales, de derechos humanos o que promueva intereses de cualquier partido pol&iacute;tico o que garanticen los derechos y garant&iacute;as de partidos pol&iacute;ticos de oposici&oacute;n, as&iacute; como los datos relativos a la salud, a la vida sexual, y los datos biom&eacute;tricos.<\\/p>\\r\\n\\r\\n<p>De acuerdo al art&iacute;culo 6 de la Ley 1581 de 2012 est&aacute; prohibido el tratamiento de datos sensibles, excepto cuando:<\\/p>\\r\\n\\r\\n<p>a) El Titular haya dado su autorizaci&oacute;n expl&iacute;cita a dicho Tratamiento, salvo en los casos que por ley no sea requerido el otorgamiento de dicha autorizaci&oacute;n;<\\/p>\\r\\n\\r\\n<p>b) El Tratamiento sea necesario para salvaguardar el inter&eacute;s vital del Titular y este se encuentre f&iacute;sica o jur&iacute;dicamente incapacitado. En estos eventos, los representantes legales deber&aacute;n otorgar su autorizaci&oacute;n;<\\/p>\\r\\n\\r\\n<p>c) El Tratamiento sea efectuado en el curso de las actividades leg&iacute;timas y con las debidas garant&iacute;as por parte de una fundaci&oacute;n, ONG, asociaci&oacute;n o cualquier otro organismo sin &aacute;nimo de lucro, cuya finalidad sea pol&iacute;tica, filos&oacute;fica, religiosa o sindical, siempre que se refieran exclusivamente a sus miembros o a las personas que mantengan contactos regulares por raz&oacute;n de su finalidad. En estos eventos, los datos no se podr&aacute;n suministrar a terceros sin la autorizaci&oacute;n del Titular;<\\/p>\\r\\n\\r\\n<p>d) El Tratamiento se refiera a datos que sean necesarios para el reconocimiento, ejercicio o defensa de un derecho en un proceso judicial;<\\/p>\\r\\n\\r\\n<p>e) El Tratamiento tenga una finalidad hist&oacute;rica, estad&iacute;stica o cient&iacute;fica. En este evento deber&aacute;n adoptarse las medidas conducentes a la supresi&oacute;n de identidad de los Titulares.<\\/p>\\r\\n\\r\\n<p><strong>GRUPO SYS S.A.S,<\\/strong> no tratar&aacute; datos sensibles, excepto cuando &eacute;sta se encuentre en alguna de las causales establecidas anteriormente. De tratarse datos sensibles por <strong>GRUPO SYS S.A.S.,<\\/strong> seg&uacute;n los par&aacute;metros establecidos atr&aacute;s, &eacute;sta informar&aacute; al titular lo siguiente:<\\/p>\\r\\n\\r\\n<p>&nbsp;<\\/p>\\r\\n\\r\\n<ul>\\r\\n\\t<li>Que por tratarse de datos sensibles no est&aacute; obligado a autorizar su Tratamiento.<\\/li>\\r\\n<\\/ul>\\r\\n\\r\\n<p>&nbsp;<\\/p>\\r\\n\\r\\n<ul>\\r\\n\\t<li>Cu&aacute;les de los datos ser&aacute;n objeto de Tratamiento y la finalidad del Tratamiento.<\\/li>\\r\\n<\\/ul>\\r\\n\\r\\n<p>&nbsp;<\\/p>\\r\\n\\r\\n<p>La autorizaci&oacute;n del tratamiento de datos sensibles ser&aacute; expresa por parte del titular. No obstante lo anterior, los clientes de GRUPO SYS S.A.S si se encuentran autorizados para el manejo y tratamiento de datos Sensibles, sus titulares se encuentran facultados a solicitar directamente con el cliente de GRUPO SYS S.A.S conocer, actualizar, rectificar modificaci&oacute;n, supresi&oacute;n, de la informaci&oacute;n sensible que se encuentre en dichas bases de datos.<\\/p>\\r\\n\\r\\n<p>&nbsp;<\\/p>\\r\\n\\r\\n<ol>\\r\\n\\t<li><strong>DERECHOS DE LOS TITULARES DE DATOS PERSONALES<\\/strong><\\/li>\\r\\n<\\/ol>\\r\\n\\r\\n<p>&nbsp;<\\/p>\\r\\n\\r\\n<p>De acuerdo a la Ley 1581 de 2012 art&iacute;culo 3&ordm;, se entiende por &lsquo;<em>Titular<\\/em>&rsquo;, toda persona natural cuyos datos personales sean objeto de tratamiento.<strong> GRUPO SYS S.A.S <\\/strong>es informa a los Titulares de datos personales que los derechos que pueden ejercer de acuerdo con la Ley 1581 de 2012, son los siguientes:<\\/p>\\r\\n\\r\\n<p>&nbsp;<\\/p>\\r\\n\\r\\n<ul>\\r\\n\\t<li>Conocer, actualizar y rectificar sus datos personales: el titular del dato tiene la obligaci&oacute;n de rectificar y\\/o actualizar la informaci&oacute;n por medio v&iacute;a correo electr&oacute;nico con el fin que la informaci&oacute;n quede almacenada de forma correcta. Este derecho se podr&aacute; ejercer, frente a datos parciales, inexactos, incompletos, fraccionados, que induzcan a error, o aquellos cuyo Tratamiento est&eacute; expresamente prohibido o no haya sido autorizado.<\\/li>\\r\\n<\\/ul>\\r\\n\\r\\n<p>&nbsp;<\\/p>\\r\\n\\r\\n<ul>\\r\\n\\t<li>Solicitar prueba de la autorizaci&oacute;n otorgada por parte de cualquier usuario o cliente de <strong>GRUPO SYS S.A.S<\\/strong> salvo cuando expresamente se except&uacute;e como requisito para el Tratamiento, de conformidad con lo previsto en el art&iacute;culo 10 de la Ley 1581 de 2012.<\\/li>\\r\\n<\\/ul>\\r\\n\\r\\n<p>&nbsp;<\\/p>\\r\\n\\r\\n<ul>\\r\\n\\t<li>Cuando el titular del dato lo solicite, el <strong>GRUPO SYS S.A.S <\\/strong>debe suministrar la informaci&oacute;n requerida respecto al tratamiento que se ha hecho al dato personal.<\\/li>\\r\\n<\\/ul>\\r\\n\\r\\n<p>&nbsp;<\\/p>\\r\\n\\r\\n<ul>\\r\\n\\t<li>Ser informado cuando su dato esta siendo usado por un tercero previa autorizaci&oacute;n del titular.<\\/li>\\r\\n<\\/ul>\\r\\n\\r\\n<p>&nbsp;<\\/p>\\r\\n\\r\\n<ul>\\r\\n\\t<li>Presentar ante la Superintendencia de Industria y Comercio quejas por infracciones a lo dispuesto en la Ley 1581 de 2012 y las dem&aacute;s normas que la modifiquen, adicionen o complementen.<\\/li>\\r\\n<\\/ul>\\r\\n\\r\\n<p>&nbsp;<\\/p>\\r\\n\\r\\n<ul>\\r\\n\\t<li>Revocar la autorizaci&oacute;n y\\/o solicitar la supresi&oacute;n del dato en cualquier momento, sin necesidad de dar explicaci&oacute;n o pago de multa o penalizaci&oacute;n, excepto que exista una relaci&oacute;n legal o contractual.<\\/li>\\r\\n<\\/ul>\\r\\n\\r\\n<p>&nbsp;<\\/p>\\r\\n\\r\\n<ol>\\r\\n\\t<li><strong>DEBERES DE GRUPO SYS S.A.S<\\/strong><\\/li>\\r\\n<\\/ol>\\r\\n\\r\\n<p>&nbsp;<\\/p>\\r\\n\\r\\n<p>Los deberes de <strong>GRUPO SYS S.A.S<\\/strong><strong>,<\\/strong> son los siguientes:<\\/p>\\r\\n\\r\\n<p>&nbsp;<\\/p>\\r\\n\\r\\n<ul>\\r\\n\\t<li>Solicitar la autorizaci&oacute;n respectiva a los empleados, Clientes, usuarios y cualquier otro tercero con relaciones de car&aacute;cter laboral, civil y\\/o comercial;<\\/li>\\r\\n<\\/ul>\\r\\n\\r\\n<p>&nbsp;<\\/p>\\r\\n\\r\\n<ul>\\r\\n\\t<li>Garantizar al Titular de los datos personales, en todo tiempo, el pleno y efectivo ejercicio parala protecci&oacute;n del derecho de H&aacute;beas Data;<\\/li>\\r\\n<\\/ul>\\r\\n\\r\\n<p>&nbsp;<\\/p>\\r\\n\\r\\n<ul>\\r\\n\\t<li>Solicitar y conservar, copia de la respectiva autorizaci&oacute;n otorgada por el Titular;<\\/li>\\r\\n<\\/ul>\\r\\n\\r\\n<p>&nbsp;<\\/p>\\r\\n\\r\\n<ul>\\r\\n\\t<li>Informar debidamente a las constructoras, agentes inmobiliarios e inmobiliarias, las cuales hacen parte del listado de clientes de <strong>GRUPO SYS S.A.S,<\\/strong> el deber que tienen de informar al Titular de los datos personales sobre la finalidad de la recolecci&oacute;n y los derechos que le asisten por virtud de la autorizaci&oacute;n otorgada;<\\/li>\\r\\n<\\/ul>\\r\\n\\r\\n<p>&nbsp;<\\/p>\\r\\n\\r\\n<ul>\\r\\n\\t<li>Conservar la informaci&oacute;n bajo las condiciones de seguridad necesarias para impedir su alteraci&oacute;n, p&eacute;rdida, consulta, uso o acceso no autorizado o fraudulento;<\\/li>\\r\\n<\\/ul>\\r\\n\\r\\n<p>&nbsp;<\\/p>\\r\\n\\r\\n<ul>\\r\\n\\t<li>El Dato Personal sometido a Tratamiento deber&aacute; ser veraz, completo, exacto, actualizado, comprobable y comprensible.<\\/li>\\r\\n<\\/ul>\\r\\n\\r\\n<p>&nbsp;<\\/p>\\r\\n\\r\\n<ul>\\r\\n\\t<li>Eliminar la informaci&oacute;n de cualquier Titular que se encuentre incluido en una base de datos, el titular, solicite dicha eliminaci&oacute;n y no exista ning&uacute;n deber legal o contractual de permanecer en las bases de datos de la SIC.<\\/li>\\r\\n<\\/ul>\\r\\n\\r\\n<p>&nbsp;<\\/p>\\r\\n\\r\\n<ul>\\r\\n\\t<li>Rectificar la informaci&oacute;n cuando sea incorrecta y haya sido comunicada de forma pertinentemente por parte del titular del dato personal;<\\/li>\\r\\n<\\/ul>\\r\\n\\r\\n<p>&nbsp;<\\/p>\\r\\n\\r\\n<ul>\\r\\n\\t<li>Mantener en todo momento el respeto a las condiciones de seguridad y privacidad en el Tratamiento de la informaci&oacute;n del Titular.<\\/li>\\r\\n<\\/ul>\\r\\n\\r\\n<p>&nbsp;<\\/p>\\r\\n\\r\\n<ul>\\r\\n\\t<li>Tramitar las consultas y reclamos formulados en los t&eacute;rminos se&ntilde;alados en la Ley;<\\/li>\\r\\n<\\/ul>\\r\\n\\r\\n<p>&nbsp;<\\/p>\\r\\n\\r\\n<ul>\\r\\n\\t<li>Informar a solicitud del Titular sobre el uso dado a sus datos;<\\/li>\\r\\n<\\/ul>\\r\\n\\r\\n<p>&nbsp;<\\/p>\\r\\n\\r\\n<ul>\\r\\n\\t<li>Informar a la autoridad de protecci&oacute;n de datos cuando se presenten violaciones a los c&oacute;digos de seguridad y existan riesgos en la administraci&oacute;n de la informaci&oacute;n de los Titulares.<\\/li>\\r\\n<\\/ul>\\r\\n\\r\\n<p>&nbsp;<\\/p>\\r\\n\\r\\n<ul>\\r\\n\\t<li>Cumplir con las instrucciones y requerimientos que imparta la Superintendencia de Industria y Comercio.<\\/li>\\r\\n<\\/ul>\\r\\n\\r\\n<p>&nbsp;<\\/p>\\r\\n\\r\\n<ol>\\r\\n\\t<li><strong>&Aacute;REA RESPONSABLE DE LA ATENCI&Oacute;N DE PETICIONES, CONSULTAS Y RECLAMOS<\\/strong><\\/li>\\r\\n<\\/ol>\\r\\n\\r\\n<p>&nbsp;<\\/p>\\r\\n\\r\\n<p>En <strong>GRUPO SYS S.A.S <\\/strong>el &aacute;rea responsable de la atenci&oacute;n de peticiones, consultas y reclamos ser&aacute; el &aacute;rea departamento operativo de la sociedad.<\\/p>\\r\\n\\r\\n<p>&nbsp;<\\/p>\\r\\n\\r\\n<ol>\\r\\n\\t<li><strong>PROCESO DE ALMACENAMIENTO<\\/strong><\\/li>\\r\\n<\\/ol>\\r\\n\\r\\n<p>&nbsp;<\\/p>\\r\\n\\r\\n<p>Una vez recolectados los datos personales por medio de la inclusi&oacute;n de la informaci&oacute;n solicitada por el cliente o el usuario en la plataforma, se conformar&aacute; una base de datos (conjunto organizado de datos personales que sea objeto de Tratamiento). Estos datos personales s&oacute;lo pueden ser tratados por el GRUPO SYS S.A.S para cumplir las finalidades del negocio.<\\/p>\\r\\n\\r\\n<p>&nbsp;<\\/p>\\r\\n\\r\\n<p>Los datos personales se almacenan de la forma m&aacute;s adecuada y segura, configurando una obligaci&oacute;n de medio y no de resultado. <strong>GRUPO SYS S.A.S<\\/strong> tomar&aacute; todas las medidas de precauci&oacute;n para proteger su informaci&oacute;n contra p&eacute;rdida, abuso, adulteraci&oacute;n, acceso o uso no autorizado o fraudulento.<\\/p>\\r\\n\\r\\n<p>&nbsp;<\\/p>\\r\\n\\r\\n<ol>\\r\\n\\t<li><strong>LEGITIMACI&Oacute;N PARA EL EJERCICIO DE LOS DERECHOS DE LOS TITULARES<\\/strong><\\/li>\\r\\n<\\/ol>\\r\\n\\r\\n<p>&nbsp;<\\/p>\\r\\n\\r\\n<p>Los derechos de los Titulares establecidos en la Ley, podr&aacute;n ejercerse por las siguientes personas:<\\/p>\\r\\n\\r\\n<p>&nbsp;<\\/p>\\r\\n\\r\\n<ol>\\r\\n\\t<li>Por el Titular, quien deber&aacute; acreditar su identidad en forma suficiente por los distintos medios que le ponga a disposici&oacute;n el responsable (Documento de identidad, o registro Civil de nacimiento)<\\/li>\\r\\n<\\/ol>\\r\\n\\r\\n<p>&nbsp;<\\/p>\\r\\n\\r\\n<ol>\\r\\n\\t<li>Por sus causahabientes en caso que muera el titular del derecho, quienes deber&aacute;n acreditar tal calidad. Cuando se trata de menores de edad dichos causahabientes pueden ser los padres, los hermano, los abuelos o los t&iacute;os quienes deber&aacute;n acreditar dicha condici&oacute;n por medio de los diferentes documentos legales dispuestos para tal finalidad.&nbsp;<\\/li>\\r\\n<\\/ol>\\r\\n\\r\\n<p>&nbsp;<\\/p>\\r\\n\\r\\n<ol>\\r\\n\\t<li>Por el representante y\\/o apoderado del Titular, previa acreditaci&oacute;n de la representaci&oacute;n o apoderamiento.<\\/li>\\r\\n<\\/ol>\\r\\n\\r\\n<p>&nbsp;<\\/p>\\r\\n\\r\\n<ol>\\r\\n\\t<li>Por estipulaci&oacute;n a favor de otro o para otro<\\/li>\\r\\n<\\/ol>\\r\\n\\r\\n<p>&nbsp;<\\/p>\\r\\n\\r\\n<ol>\\r\\n\\t<li><strong>SUPRESI&Oacute;N O REVOCATORIA DE LA INFORMACI&Oacute;N TRATADA POR GRUPO SYS S.A.S.<\\/strong><\\/li>\\r\\n<\\/ol>\\r\\n\\r\\n<p>&nbsp;<\\/p>\\r\\n\\r\\n<p>Se les informa a los titulares de datos personales que la supresi&oacute;n o revocatoria de autorizaci&oacute;n de tratamiento de datos no proceder&aacute;n cuando el titular tenga un deber legal o contractual de permanecer en la base de datos de <strong>GRUPO SYS S.A.S.<\\/strong><\\/p>\\r\\n\\r\\n<p>&nbsp;<\\/p>\\r\\n\\r\\n<ol>\\r\\n\\t<li><strong>PROCEDIMIENTO DE CONSULTA<\\/strong><\\/li>\\r\\n<\\/ol>\\r\\n\\r\\n<p>&nbsp;<\\/p>\\r\\n\\r\\n<p>Los Titulares de datos personales, los causahabientes o la persona legitimada de acuerdo al art&iacute;culo 20 del Decreto 1377 de 2013, podr&aacute;n solicitar la consulta de sus datos personales directamente al correo electr&oacute;nico servicioalcliente@areaprivada.co con m&iacute;nimo la siguiente informaci&oacute;n:<\\/p>\\r\\n\\r\\n<p>&nbsp;<\\/p>\\r\\n\\r\\n<ol>\\r\\n\\t<li>La identificaci&oacute;n completa del Titular, causahabiente o autorizado de los datos personales.<\\/li>\\r\\n\\t<li>Los datos personales que quieren ser consultados,<\\/li>\\r\\n\\t<li>Direcci&oacute;n del solicitante,<\\/li>\\r\\n\\t<li>Correo electr&oacute;nico del solicitante<\\/li>\\r\\n\\t<li>En caso de ser causahabientes o cualquier otra persona legitimada de acuerdo al art&iacute;culo 20 del Decreto 1377 de 2013 deber&aacute; anexar el respectivo documento que demuestre su legitimidad.<\\/li>\\r\\n<\\/ol>\\r\\n\\r\\n<p>&nbsp;<\\/p>\\r\\n\\r\\n<p>La consulta ser&aacute; atendida por <strong>GRUPO SYS S.A.S,<\\/strong> en un t&eacute;rmino m&aacute;ximo de diez (10) d&iacute;as h&aacute;biles contados a partir de la fecha de recibo de la consulta por correo electr&oacute;nico. Cuando no fuere posible atender la consulta dentro de dicho t&eacute;rmino,<strong> GRUPO SYS S.A.S<\\/strong> informar&aacute; al interesado expresando los motivos de la demora y se&ntilde;alando la fecha en que se atender&aacute; su solicitud, la cual no podr&aacute; superar los cinco (5) d&iacute;as h&aacute;biles siguientes al vencimiento del primer t&eacute;rmino.<\\/p>\\r\\n\\r\\n<p>&nbsp;<\\/p>\\r\\n\\r\\n<p>Cuando la consulta no sea clara, no se entienda, o no cumpla los requisitos necesarios para desarrollar una respuesta por parte de <strong>GRUPO SYS S.A.S<\\/strong>, &eacute;sta le informar&aacute; al titular, causahabiente o autorizado para que nuevamente presente la consulta a m&aacute;s tardar dentro de los cinco (5) d&iacute;as h&aacute;biles siguientes al requerimiento por parte de la sociedad. Transcurrido dos (2) meses desde la fecha del requerimiento, sin que el solicitante presente la informaci&oacute;n requerida,<strong> GRUPO SYS S.A.S <\\/strong>entender&aacute;, que el titular o causahabiente ha desistido de la consulta y proceder&aacute; con el archivo de la misma.<\\/p>\\r\\n\\r\\n<p>&nbsp;<\\/p>\\r\\n\\r\\n<ol>\\r\\n\\t<li><strong>PROCEDIMIENTO DE RECLAMO<\\/strong><\\/li>\\r\\n<\\/ol>\\r\\n\\r\\n<p>El Titular o causahabiente cuando considere que la informaci&oacute;n contenida en una base de datos deba ser objeto de correcci&oacute;n, actualizaci&oacute;n, supresi&oacute;n o revocatoria de la autorizaci&oacute;n de Tratamiento de datos personales o cuando adviertan el presunto incumplimiento de cualquiera de los deberes contenidos en la Ley 1581 de 2012, podr&aacute;n presentar reclamo directamente con la Instituci&oacute;n Educativa responsable de la base de datos y tratamiento de la informaci&oacute;n. Dicha Instituci&oacute;n Educativa deber&aacute; presentar como m&iacute;nimo la siguiente informaci&oacute;n:<\\/p>\\r\\n\\r\\n<ol>\\r\\n\\t<li>La identificaci&oacute;n completa del Titular, causahabiente o autorizado para la correcci&oacute;n, actualizaci&oacute;n, supresi&oacute;n o revocatoria de la autorizaci&oacute;n de Tratamiento de datos personales.<\\/li>\\r\\n\\t<li>Descripci&oacute;n de los hechos que dan lugar al reclamo de forma clara y detallada,<\\/li>\\r\\n\\t<li>Direcci&oacute;n del domicilio de quien presenta la queja o reclamos<\\/li>\\r\\n\\t<li>correo electr&oacute;nico de quien presenta la queja o reclamo<\\/li>\\r\\n\\t<li>En caso de ser causahabientes o cualquier otra persona legitimada de acuerdo al art&iacute;culo 20 del Decreto 1377 de 2013 deber&aacute; anexar el respectivo documento que demuestre su legitimidad,<\\/li>\\r\\n\\t<li>Acompa&ntilde;amiento de los documentos que el Titular, causahabiente o cualquier otra persona legitimada por el art&iacute;culo 20 del Decreto 1377 de 2013, quiere hacer valer.<\\/li>\\r\\n<\\/ol>\\r\\n\\r\\n<p>En caso que quien reciba el reclamo no sea competente para resolverlo, dar&aacute; traslado a quien corresponda en un t&eacute;rmino m&aacute;ximo de cinco (5) d&iacute;as h&aacute;biles e informar&aacute; de la situaci&oacute;n al interesado.<\\/p>\\r\\n\\r\\n<p>Si el reclamo resulta incompleto, no sea claro o no se entienda <strong>GRUPO SYS S.A.S<\\/strong> requerir&aacute; al interesado dentro de los cinco (5) d&iacute;as h&aacute;biles siguientes a la recepci&oacute;n del reclamo para que subsane las fallas. Transcurrido dos (2) meses desde la fecha del requerimiento, sin que el solicitante presente la informaci&oacute;n requerida, el<strong> GRUPO SYS S.A.S <\\/strong>entender&aacute;, que el Titular, causahabiente o autorizado ha desistido del reclamo. Y por lo tanto <strong>GRUPO SYS S.A.S<\\/strong> proceder&aacute; con el archivo del reclamo.<\\/p>\\r\\n\\r\\n<p>Una vez recibido el reclamo completo, se incluir&aacute; en la base de datos una leyenda que diga &quot;reclamo en tr&aacute;mite&quot; y el motivo del mismo, en un t&eacute;rmino no mayor a dos (2) d&iacute;as h&aacute;biles. Dicha leyenda deber&aacute; mantenerse hasta que el reclamo sea decidido.<\\/p>\\r\\n\\r\\n<p><strong>GRUPO SYS S.A.S <\\/strong>dar&aacute; respuesta al reclamo en un t&eacute;rmino m&aacute;ximo de quince (15) d&iacute;as h&aacute;biles contados a partir del d&iacute;a siguiente a la fecha de su recibo. Cuando no fuere posible atender el reclamo dentro de dicho t&eacute;rmino, se informar&aacute; al interesado los motivos de la demora y la fecha en que se atender&aacute; su reclamo, la cual no podr&aacute; superar los ocho (8) d&iacute;as h&aacute;biles siguientes al vencimiento del primer t&eacute;rmino<\\/p>\\r\\n\\r\\n<p>&nbsp;<\\/p>\\r\\n\\r\\n<p><strong>SE LE INFORMA A LOS TITULARES DE DATOS PERSONALES QUE LA SUPRESI&Oacute;N O REVOCATORIA DE AUTORIZACI&Oacute;N DE TRATAMIENTO DE DATOS NO PROCEDER&Aacute;N CUANDO EL TITULAR TENGA UN DEBER LEGAL O CONTRACTUAL DE PERMANECER EN LA BASE DE DATOS DE GRUPO SYS S.A.S.<\\/strong><\\/p>\\r\\n\\r\\n<p>&nbsp;<\\/p>\\r\\n\\r\\n<ol>\\r\\n\\t<li><strong>LIMITACIONES TEMPORALES AL TRATAMIENTO DE LOS DATOS PERSONALES<\\/strong><\\/li>\\r\\n<\\/ol>\\r\\n\\r\\n<p>&nbsp;<\\/p>\\r\\n\\r\\n<p>De acuerdo al Decreto 1377 de 2013, <strong>GRUPO SYS S.A.S<\\/strong>, s&oacute;lo podr&aacute; almacenar, o circular los datos personales de una persona, durante el tiempo que tenga vigente la suscripci&oacute;n a la plataforma. Una vez el usuario o cliente se retire de la plataforma, y sin perjuicio de normas legales que dispongan lo contrario <strong>GRUPO SYS S.A.S, <\\/strong>proceder&aacute; a la supresi&oacute;n de los datos personales en su posesi&oacute;n.<\\/p>\\r\\n\\r\\n<p>&nbsp;<\\/p>\\r\\n\\r\\n<p>Como excepci&oacute;n a lo anterior <strong>GRUPO SYS S.A.S <\\/strong>podr&aacute; conservar los datos personales cuando as&iacute; se requiera para el cumplimiento de una obligaci&oacute;n legal o contractual.<\\/p>\\r\\n\\r\\n<p>&nbsp;<\\/p>\\r\\n\\r\\n<ol>\\r\\n\\t<li><strong>INDEMNIDAD DE GRUPO SYS S.A.S.<\\/strong><\\/li>\\r\\n<\\/ol>\\r\\n\\r\\n<p>&nbsp;<\\/p>\\r\\n\\r\\n<p>Se presume que la informaci&oacute;n recolectada y entregada de forma voluntaria por parte del titular de dato persona es verdadera, exacta y actualizada. El incumpliendo de esta obligaci&oacute;n por parte del usuario mantendr&aacute; indemne a GRUPO SYS S.A.S., por el uso que se haga de esa informaci&oacute;n falsa, inexacta o desactualizada por parte de GRUPO SYS S.A.S., o los terceros que accedan a ella para cumplir con la finalidad de la relaci&oacute;n comercial.<\\/p>\\r\\n\\r\\n<p>&nbsp;<\\/p>\\r\\n\\r\\n<ol>\\r\\n\\t<li><strong>ACEPTACION Y VIGENCIA DE LA AUTORIZACION<\\/strong><\\/li>\\r\\n<\\/ol>\\r\\n\\r\\n<p>&nbsp;<\\/p>\\r\\n\\r\\n<p>En el momento que se selecciona la casilla correspondiente se entiende que se ha aceptado el presente documento y el tratamiento de la informaci&oacute;n explicado. Quien no acepte dicha pol&iacute;tica de privacidad, no podr&aacute; registrarse como usuario o cliente de la plataforma.<\\/p>\\r\\n\\r\\n<p>&nbsp;<\\/p>\\r\\n\\r\\n<p>El presente documento de pol&iacute;tica de privacidad constituye copia de la autorizaci&oacute;n otorgada por el titular del dato personal; as&iacute; mismo, GRUPO SYS S.A.S., guardar&aacute; copia de esta, junto con las actualizaciones y modificaciones que se puedan llegar a realizar en el futuro de conformidad a lo requerido y establecido en la Ley y Decretos correspondientes.<\\/p>\\r\\n\\r\\n<p>&nbsp;<\\/p>\\r\\n\\r\\n<ol>\\r\\n\\t<li><strong>VIGENCIA DE LA POL&Iacute;TICA DE TRATAMIENTO DE INFORMACI&Oacute;N<\\/strong><\\/li>\\r\\n<\\/ol>\\r\\n\\r\\n<p>&nbsp;<\\/p>\\r\\n\\r\\n<p>Esta pol&iacute;tica de tratamiento desarrollada por la sociedad&nbsp;<strong>GRUPO SYS S.A.S.<\\/strong>&nbsp;&nbsp;Inicia su vigencia desde&nbsp;el _____ (__) del mes de ______ del a&ntilde;o dos mil diecinueve (2019).&nbsp;<\\/p>\\r\\n\\r\\n<p>&nbsp;<\\/p>\\r\\n\\r\\n<p>&nbsp;<\\/p>\",\"_token\":\"Kw1tTA7kVn4aZw3PnAGvDumFY1ab7uqngiHgqhhY\",\"_method\":\"PUT\"}','2019-08-20 19:55:44','2019-08-20 19:55:44'),(7352,2,'admin/politicas','GET','186.31.137.182','[]','2019-08-20 19:55:44','2019-08-20 19:55:44'),(7353,1,'admin',