2,'admin/noticias','GET','190.146.249.12','{\"_pjax\":\"#pjax-container\"}','2019-08-21 11:57:16','2019-08-21 11:57:16'),(7412,2,'admin/noticias/1/edit','GET','190.146.249.12','{\"_pjax\":\"#pjax-container\"}','2019-08-21 12:05:59','2019-08-21 12:05:59'),(7413,2,'admin/noticias/1','PUT','190.146.249.12','{\"titulo\":\"\\u00bfNo sabe en qu\\u00e9 invertir? 5 razones para hacerlo en el sector inmobiliario\",\"sub_titulo\":null,\"descripcion\":\"<p>Invertir, diversificar y ahorrar son temas que seguramente le deben resonar ocasionalmente. Hoy le tenemos un tip: el mercado inmobiliario en Colombia es un nicho altamente potencial que goza de un excelente panorama. Si est&aacute; pensando en invertir para mejorar sus finanzas personales o quiere emprender un negocio, le damos cinco razones para que tome acci&oacute;n en este mercado que viene al alza.<\\/p>\\r\\n\\r\\n<ol>\\r\\n\\t<li>El &uacute;ltimo informe corporativo de Colliers International revel&oacute; que el mercado inmobiliario tuvo un repunte durante el &uacute;ltimo trimestre de 2018, respecto al 2017 el incremento fue del 7 %. Adem&aacute;s, el informe pronostica que continuar&aacute; en alza durante el 2019.<\\/li>\\r\\n\\t<li>&iquest;Sab&iacute;a usted que Bogot&aacute; es la capital que m&aacute;s arrienda en Latinoam&eacute;rica? Jorge Rovira, Gerente de Compass Group en Colombia, asegur&oacute; que la capital del pa&iacute;s se ha convertido en un atractivo para el sector inmobiliario en Latinoam&eacute;rica.<\\/li>\\r\\n\\t<li>De acuerdo con el &uacute;ltimo informe del DANE (2017), el 34,5 % de las personas en Colombia viven en arriendo. Comprar para luego arrendar no es mala idea, &iexcl;la oferta es amplia!<\\/li>\\r\\n\\t<li>De acuerdo con Francisco Pailli&eacute;, director de RE\\/MAX en Colombia, en nuestro pa&iacute;s se negocian &iexcl;700.000 inmuebles al a&ntilde;o! Seg&uacute;n &eacute;l, este n&uacute;mero nos revela que el mercado inmobiliario es un excelente sector para invertir.<\\/li>\\r\\n\\t<li>El GRI Group realiz&oacute; un estudio donde encuest&oacute; a 340 empresarios del sector inmobiliario en Latinoam&eacute;rica. El 81,5 % de los empresarios esperan resultados positivos en Colombia, mientras que en el resto de pa&iacute;ses de la regi&oacute;n sus pron&oacute;sticos no son tan prometedores.<\\/li>\\r\\n<\\/ol>\\r\\n\\r\\n<p>&iquest;Sabe qu&eacute; tienen en com&uacute;n estas cifras? Que todas nos permiten concluir que el sector inmobiliario tiene buena perspectiva de crecimiento en el 2019. &iquest;Qu&eacute; espera para empezar?<\\/p>\\r\\n\\r\\n<p>&nbsp;<\\/p>\",\"_token\":\"dJsAKEOPuYGGLm9JvMtojD3mzlasyo2bLBA5aleN\",\"_method\":\"PUT\"}','2019-08-21 12:10:55','2019-08-21 12:10:55'),(7414,2,'admin/noticias/1','PUT','190.146.249.12','{\"titulo\":\"\\u00bfNo sabe en qu\\u00e9 invertir? 5 razones para hacerlo en el sector inmobiliario\",\"sub_titulo\":null,\"descripcion\":\"<p>Invertir, diversificar y ahorrar son temas que seguramente le deben resonar ocasionalmente. Hoy le tenemos un tip: el mercado inmobiliario en Colombia es un nicho altamente potencial que goza de un excelente panorama. Si est&aacute; pensando en invertir para mejorar sus finanzas personales o quiere emprender un negocio, le damos cinco razones para que tome acci&oacute;n en este mercado que viene al alza.<\\/p>\\r\\n\\r\\n<ol>\\r\\n\\t<li>El &uacute;ltimo informe corporativo de Colliers International revel&oacute; que el mercado inmobiliario tuvo un repunte durante el &uacute;ltimo trimestre de 2018, respecto al 2017 el incremento fue del 7 %. Adem&aacute;s, el informe pronostica que continuar&aacute; en alza durante el 2019.<\\/li>\\r\\n\\t<li>&iquest;Sab&iacute;a usted que Bogot&aacute; es la capital que m&aacute;s arrienda en Latinoam&eacute;rica? Jorge Rovira, Gerente de Compass Group en Colombia, asegur&oacute; que la capital del pa&iacute;s se ha convertido en un atractivo para el sector inmobiliario en Latinoam&eacute;rica.<\\/li>\\r\\n\\t<li>De acuerdo con el &uacute;ltimo informe del DANE (2017), el 34,5 % de las personas en Colombia viven en arriendo. Comprar para luego arrendar no es mala idea, &iexcl;la oferta es amplia!<\\/li>\\r\\n\\t<li>De acuerdo con Francisco Pailli&eacute;, director de RE\\/MAX en Colombia, en nuestro pa&iacute;s se negocian &iexcl;700.000 inmuebles al a&ntilde;o! Seg&uacute;n &eacute;l, este n&uacute;mero nos revela que el mercado inmobiliario es un excelente sector para invertir.<\\/li>\\r\\n\\t<li>El GRI Group realiz&oacute; un estudio donde encuest&oacute; a 340 empresarios del sector inmobiliario en Latinoam&eacute;rica. El 81,5 % de los empresarios esperan resultados positivos en Colombia, mientras que en el resto de pa&iacute;ses de la regi&oacute;n sus pron&oacute;sticos no son tan prometedores.<\\/li>\\r\\n<\\/ol>\\r\\n\\r\\n<p>&iquest;Sabe qu&eacute; tienen en com&uacute;n estas cifras? Que todas nos permiten concluir que el sector inmobiliario tiene buena perspectiva de crecimiento en el 2019. &iquest;Qu&eacute; espera para empezar?<\\/p>\\r\\n\\r\\n<p>&nbsp;<\\/p>\",\"_token\":\"dJsAKEOPuYGGLm9JvMtojD3mzlasyo2bLBA5aleN\",\"_method\":\"PUT\"}','2019-08-21 12:11:01','2019-08-21 12:11:01'),(7415,2,'admin/noticias','GET','190.146.249.12','{\"_pjax\":\"#pjax-container\"}','2019-08-21 12:11:03','2019-08-21 12:11:03'),(7416,2,'admin/noticias/1/edit','GET','190.146.249.12','{\"_pjax\":\"#pjax-container\"}','2019-08-21 12:16:01','2019-08-21 12:16:01'),(7417,2,'admin/noticias','GET','190.146.249.12','{\"_pjax\":\"#pjax-container\"}','2019-08-21 12:18:14','2019-08-21 12:18:14'),(7418,2,'admin/noticias/create','GET','190.146.249.12','{\"_pjax\":\"#pjax-container\"}','2019-08-21 12:18:16','2019-08-21 12:18:16'),(7419,2,'admin/noticias','POST','190.146.249.12','{\"titulo\":\"\\u00bfEn qu\\u00e9 continente crees que est\\u00e1n los rascacielos m\\u00e1s altos y lujosos del mundo?\",\"sub_titulo\":null,\"descripcion\":\"<p>&iexcl;El primer edificio denominado un rascacielos ten&iacute;a 5 pisos! Sin embargo, hoy un edificio de esta altura es habitual. A trav&eacute;s de los a&ntilde;os el hombre se ha preocupado por construir edificaciones a&uacute;n m&aacute;s altas. Por eso, hoy en d&iacute;a se le denomina rascacielos a un edificio que supera los 100 metros de altura. Estos son los cinco rascacielos m&aacute;s altos del mundo. &iexcl;Al final te tenemos un dato sorprendente!<\\/p>\\r\\n\\r\\n<ol>\\r\\n\\t<li>Burj Khalifa<\\/li>\\r\\n<\\/ol>\\r\\n\\r\\n<p>Proveniente de un pa&iacute;s rico en petr&oacute;leo, este inmenso edificio tiene 828 metros de altura. Si te cansas caminando un kil&oacute;metro, &iexcl;imag&iacute;nate subiendo por las escales de esta joya arquitect&oacute;nica! Est&aacute; ubicado en los Emiratos &Aacute;rabes y hoy por hoy es el m&aacute;s alto del mundo. Su construcci&oacute;n cost&oacute; US $1.5 mil millones.<\\/p>\\r\\n\\r\\n<p>2. Torre de Shangai<\\/p>\\r\\n\\r\\n<p>&iquest;Cu&aacute;nto crees que puede medir un edificio de 128 pisos? Nada m&aacute;s y nada menos que 632 metros de altura. En China se encuentra la torre de Shangai, la segunda torre m&aacute;s alta del mundo.&nbsp;<\\/p>\\r\\n\\r\\n<p>3. Abraj al Bait<\\/p>\\r\\n\\r\\n<p>Una vez m&aacute;s volvemos a los pa&iacute;ses ricos en petr&oacute;leo. Este edificio est&aacute; ubicado en Arabia Saud&iacute; y tiene una altura de 601 metros.<\\/p>\\r\\n\\r\\n<p>4. Ping an Financie Center<\\/p>\\r\\n\\r\\n<p>&iexcl;Parece que este ranking lo va ganando Asia con diferencia! Volvemos a China, donde la cuarta torre m&aacute;s alta del mundo alcanza los 599 metros de altura.<\\/p>\\r\\n\\r\\n<p>5. Lotte World Tower.<\\/p>\\r\\n\\r\\n<p>&iexcl;El continente que tiene los edificios m&aacute;s altos del mundo es Asia! El Lotte World Tower es un edificio de 555 metros de altura que est&aacute; ubicado en Corea del Sur. Cuenta con 123 pisos y tiene una hermosa plataforma para contemplar la privilegiada vista.<\\/p>\\r\\n\\r\\n<p>El dato que te prometimos: El Empire State, es probablemente el rascacielos m&aacute;s famoso del mundo. Pues bien, para que te hagas una idea del tama&ntilde;o del Burj Khalifa, este edificio es el doble de alto del Empire State. 57 ascensores se encargan de bajar y subir a los habitantes, oficinistas y visitantes.<\\/p>\\r\\n\\r\\n<p>&nbsp;<\\/p>\\r\\n\\r\\n<p>&nbsp;<\\/p>\\r\\n\\r\\n<p>&nbsp;<\\/p>\\r\\n\\r\\n<p>&nbsp;<\\/p>\\r\\n\\r\\n<p>&nbsp;<\\/p>\",\"_token\":\"dJsAKEOPuYGGLm9JvMtojD3mzlasyo2bLBA5aleN\"}','2019-08-21 12:19:23','2019-08-21 12:19:23'),(7420,2,'admin/noticias/create','GET','190.146.249.12','[]','2019-08-21 12:19:24','2019-08-21 12:19:24'),(7421,2,'admin/noticias','GET','190.146.249.12','{\"_pjax\":\"#pjax-container\"}','2019-08-21 12:22:22','2019-08-21 12:22:22'),(7422,1,'admin','GET','190.146.249.12','[]','2019-08-21 12:48:27','2019-08-21 12:48:27'),(7423,1,'admin/inmuebles','GET','190.146.249.12','[]','2019-08-21 12:48:28','2019-08-21 12:48:28'),(7424,1,'admin','GET','190.146.249.12','[]','2019-08-21 13:25:59','2019-08-21 13:25:59'),(7425,1,'admin/inmuebles','GET','190.146.249.12','[]','2019-08-21 13:26:00','2019-08-21 13:26:00'),(7426,1,'admin/quienes_somos','GET','190.146.249.12','[]','2019-08-21 13:26:11','2019-08-21 13:26:11'),(7427,1,'admin/quienes_somos','GET','190.146.249.12','[]','2019-08-21 13:26:29','2019-08-21 13:26:29'),(7428,1,'admin/quienes_somos','GET','190.146.249.12','[]','2019-08-21 13:26:59','2019-08-21 13:26:59'),(7429,1,'admin/quienes_somos','GET','190.146.249.12','[]','2019-08-21 13:27:55','2019-08-21 13:27:55'),(7430,1,'admin/quienes_somos/1/edit','GET','190.146.249.12','{\"_pjax\":\"#pjax-container\"}','2019-08-21 13:27:58','2019-08-21 13:27:58'),(7431,1,'admin/auth/menu','GET','190.146.249.12','{\"_pjax\":\"#pjax-container\"}','2019-08-21 13:36:23','2019-08-21 13:36:23'),(7432,1,'admin/auth/menu','POST','190.146.249.12','{\"parent_id\":\"0\",\"title\":\"Quienes somos\",\"icon\":\"fa-bars\",\"uri\":null,\"roles\":[\"1\",\"2\",null],\"permission\":\"*\",\"_token\":\"CrbIk