estre de 2018, respecto al 2017 el incremento fue del 7 %. Adem&aacute;s, el informe pronostica que continuar&aacute; en alza durante el 2019.<\\/li>\\r\\n\\t<li>&iquest;Sab&iacute;a usted que Bogot&aacute; es la capital que m&aacute;s arrienda en Latinoam&eacute;rica? Jorge Rovira, Gerente de Compass Group en Colombia, asegur&oacute; que la capital del pa&iacute;s se ha convertido en un atractivo para el sector inmobiliario en Latinoam&eacute;rica.<\\/li>\\r\\n\\t<li>De acuerdo con el &uacute;ltimo informe del DANE (2017), el 34,5 % de las personas en Colombia viven en arriendo. Comprar para luego arrendar no es mala idea, &iexcl;la oferta es amplia!<\\/li>\\r\\n\\t<li>De acuerdo con Francisco Pailli&eacute;, director de RE\\/MAX en Colombia, en nuestro pa&iacute;s se negocian &iexcl;700.000 inmuebles al a&ntilde;o! Seg&uacute;n &eacute;l, este n&uacute;mero nos revela que el mercado inmobiliario es un excelente sector para invertir.<\\/li>\\r\\n\\t<li>El GRI Group realiz&oacute; un estudio donde encuest&oacute; a 340 empresarios del sector inmobiliario en Latinoam&eacute;rica. El 81,5 % de los empresarios esperan resultados positivos en Colombia, mientras que en el resto de pa&iacute;ses de la regi&oacute;n sus pron&oacute;sticos no son tan prometedores.<\\/li>\\r\\n<\\/ol>\\r\\n\\r\\n<p>&iquest;Sabe qu&eacute; tienen en com&uacute;n estas cifras? Que todas nos permiten concluir que el sector inmobiliario tiene buena perspectiva de crecimiento en el 2019. &iquest;Qu&eacute; espera para empezar?<\\/p>\\r\\n\\r\\n<p>prueba<\\/p>\\r\\n\\r\\n<p>&nbsp;<\\/p>\",\"_token\":\"husdgoUY49yhi5Ls0R8oQ734Sf1iZlQTrMsUFoIE\",\"_method\":\"PUT\"}','2019-08-21 14:20:02','2019-08-21 14:20:02'),(7509,1,'admin/noticias/1','PUT','190.146.249.12','{\"titulo\":\"\\u00bfNo sabe en qu\\u00e9 invertir? 5 razones para hacerlo en el sector inmobiliario\",\"sub_titulo\":null,\"descripcion\":\"<p>Invertir, diversificar y ahorrar son temas que seguramente le deben resonar ocasionalmente. Hoy le