,'190.146.249.12','[]','2019-09-06 14:55:23','2019-09-06 14:55:23'),(8442,2,'admin/textos','GET','190.146.249.12','{\"_pjax\":\"#pjax-container\"}','2019-09-06 14:55:33','2019-09-06 14:55:33'),(8443,2,'admin/textos/5/edit','GET','190.146.249.12','{\"_pjax\":\"#pjax-container\"}','2019-09-06 14:55:43','2019-09-06 14:55:43'),(8444,2,'admin/textos','GET','190.146.249.12','{\"_pjax\":\"#pjax-container\"}','2019-09-06 14:55:49','2019-09-06 14:55:49'),(8445,2,'admin/textos','GET','190.146.249.12','{\"_pjax\":\"#pjax-container\"}','2019-09-06 14:55:49','2019-09-06 14:55:49'),(8446,2,'admin/textos/2/edit','GET','190.146.249.12','[]','2019-09-06 14:58:21','2019-09-06 14:58:21'),(8447,2,'admin/textos/2','PUT','190.146.249.12','{\"texto\":\"<p>Para comenzar con el proceso de publicaci&oacute;n de tu inmueble es necesario completar estos primeros datos:<\\/p>\",\"tipo\":\"2\",\"_token\":\"15QrZ00oDBOhbo5NegY7AcBFT29rrdKrNoTSeWQU\",\"_method\":\"PUT\"}','2019-09-06 14:58:28','2019-09-06 14:58:28'),(8448,2,'admin/textos','GET','190.146.249.12','{\"_pjax\":\"#pjax-container\"}','2019-09-06 14:58:31','2019-09-06 14:58:31'),(8449,2,'admin/textos/1/edit','GET','190.146.249.12','[]','2019-09-06 14:58:37','2019-09-06 14:58:37'),(8450,2,'admin/textos/3/edit','GET','190.146.249.12','[]','2019-09-06 14:58:38','2019-09-06 14:58:38'),(8451,2,'admin/textos/4/edit','GET','190.146.249.12','[]','2019-09-06 14:58:39','2019-09-06 14:58:39'),(8452,2,'admin/textos/5/edit','GET','190.146.249.12','[]','2019-09-06 14:58:40','2019-09-06 14:58:40'),(8453,2,'admin/textos/6/edit','GET','190.146.249.12','[]','2019-09-06 14:58:40','2019-09-06 14:58:40'),(8454,2,'admin/textos/3/edit','GET','190.146.249.12','[]','2019-09-06 14:59:15','2019-09-06 14:59:15'),(8455,2,'admin/textos/3','PUT','190.146.249.12','{\"texto\":\"<p>En la publicaci&oacute;n detallada de tu inmueble, los usuarios interesados van a poder ver en el mapa la ubicaci&oacute;n exacta o cercana del inmueble, como tambi&eacute;n van a poder conocer el barrio y las calles cercanas al inmueble gracias al bot&oacute;n de street view, el cual lo mostrar&aacute; como si estuvieras caminando por ah&iacute; con im&aacute;genes reales a full color.<\\/p>\\r\\n\\r\\n<p>Para esto necesitas ubicar dentro del mapa la gota de &Aacute;rea Privada arrastr&aacute;ndola con el mouse oprimido lo m&aacute;s cercano que puedas a la ubicaci&oacute;n real del inmueble.<\\/p>\",\"tipo\":\"3\",\"_token\":\"15QrZ00oDBOhbo5NegY7AcBFT29rrdKrNoTSeWQU\",\"_method\":\"PUT\"}','2019-09-06 14:59:34','2019-09-06 14:59:34'),(8456,2,'admin/textos','GET','190.146.249.12','{\"_pjax\":\"#pjax-container\"}','2019-09-06 14:59:37','2019-09-06 14:59:37'),(8457,2,'admin/textos/4/edit','GET','190.146.249.12','[]','2019-09-06 14:59:40','2019-09-06 14:59:40'),(8458,2,'admin/textos/4','PUT','190.146.249.12','{\"texto\":\"<p>Ten en cuenta que entre m&aacute;s llamativa y completa sea la descripci&oacute;n e informaci&oacute;n que le des a tu inmueble, el usuario interesado por tu inmueble querr&aacute; generar el contacto que seguro te llevar&aacute; a concretar lo que esperas de tu publicaci&oacute;n.<\\/p>\",\"tipo\":\"4\",\"_token\":\"15QrZ00oDBOhbo5NegY7AcBFT29rrdKrNoTSeWQU\",\"_method\":\"PUT\"}','2019-09-06 14:59:56','2019-09-06 14:59:56'),(8459,2,'admin/textos','GET','190.146.249.12','{\"_pjax\":\"#pjax-container\"}','2019-09-06 14:59:59','2019-09-06 14:59:59'),(8460,2,'admin/textos/5/edit','GET','190.146.249.12','[]','2019-09-06 15:00:10','2019-09-06 15:00:10'),(8461,2,'admin/textos/5/edit','GET','190.146.249.12','[]','2019-09-06 15:00:18','2019-09-06 15:00:18'),(8462,2,'admin/textos/5','PUT','190.146.249.12','{\"texto\":\"<p>Como plus adicional para darle m&aacute;s valor a tu publicaci&oacute;n, tienes la opci&oacute;n de darle al usuario interesado las medidas de los diferentes espacios de tu inmueble, como por ejemplo; cocina, alcoba principal entre otros, esto con el fin de darle m&aacute;s detalles al usuario final y para que tambi&eacute;n pueda comparar con su inmueble actual u otras opciones que tenga, pero no te preocupes en dado caso que no cuentes con un metro a la mano, el d&iacute;a de nuestra visita para la toma de fotograf&iacute;as y video profesional, nosotros mismos ratificaremos las medidas de los espacios de inter&eacute;s.<\\/p>\\r\\n\\r\\n<p>Si deseas hacerlo tu mismo, solo basta que hagas click en NUEVO para cargar un espacio de inter&eacute;s diferente<\\/p>\",\"tipo\":\"5\",\"_token\":\"15QrZ00oDBOhbo5NegY7AcBFT29rrdKrNoTSeWQU\",\"_method\":\"PUT\"}','2019-09-06 15:01:23','2019-09-06 15:01:23'),(8463,2,'admin/textos','GET','190.146.249.12','{\"_pjax\":\"#pjax-container\"}','2019-09-06 15:01:25','2019-09-06 15:01:25'),(8464,2,'admin/textos/6/edit','GET','190.146.249.12','[]','2019-09-06 15:01:28','2019-09-06 15:01:28'),(8465,2,'admin/textos/6','PUT','190.146.249.12','{\"texto\":\"<p>Recuerda que debes mostrar muy bien el producto para lograr tus objetivos con esta publicaci&oacute;n, es por esto que nuestros paquetes incluyen la visita de uno de nuestros colaboradores para la toma de fotograf&iacute;as y videos profesionales.<\\/p>\\r\\n\\r\\n<p>- Solo es necesario que selecciones un d&iacute;a entre (martes a s&aacute;bado)<\\/p>\\r\\n\\r\\n<p>- Un horario, el que m&aacute;s te convenga.<\\/p>\\r\\n\\r\\n<p>- Llenar tus datos personal.<\\/p>\\r\\n\\r\\n<p>- Y en las siguientes 3 horas nos estaremos comunicando contigo para la confirmaci&oacute;n de la visita.<\\/p>\",\"tipo\":\"6\",\"_token\":\"15QrZ00oDBOhbo5NegY7AcBFT29rrdKrNoTSeWQU\",\"_method\":\"PUT\"}','2019-09-06 15:02:11','2019-09-06 15:02:11'),(8466,2,'admin/textos','GET','190.146.249.12','{\"_pjax\":\"#pjax-container\"}','2019-09-06 15:02:15','2019-09-06 15:02:15'),(8467,2,'admin','GET','186.86.195.243','[]','2019-09-06 23:46:41','2019-09-06 23:46:41'),(8468,2,'admin/inmuebles','GET','186.86.195.243','[]','2019-09-06 23:46:41','2019-09-06 23:46:41'),(8469,2,'admin/textos','GET','186.86.195.243','{\"_pjax\":\"#pjax-containe