a la toma de fotograf&iacute;as y videos profesionales.<br \\/>\\r\\n- Solo es necesario que selecciones un d&iacute;a entre (martes a s&aacute;bado)<br \\/>\\r\\n- Un horario, el que m&aacute;s te convenga.<br \\/>\\r\\n- Llenar tus datos personal.<br \\/>\\r\\n- Y en las siguientes 3 horas nos estaremos comunicando contigo para la confirmaci&oacute;n de la visita.<\\/p>\",\"tipo\":\"8\",\"_token\":\"H9R194LqoJci4QTivTXCbvrtuNTbiw3UTJSEYZBZ\",\"_method\":\"PUT\"}','2019-09-10 13:29:53','2019-09-10 13:29:53'),(8620,2,'admin/textos','GET','186.86.195.243','{\"_pjax\":\"#pjax-container\"}','2019-09-10 13:31:26','2019-09-10 13:31:26'),(8621,2,'admin/textos/6/edit','GET','186.86.195.243','{\"_pjax\":\"#pjax-container\"}','2019-09-10 13:31:29','2019-09-10 13:31:29'),(8622,2,'admin/textos/6','PUT','186.86.195.243','{\"texto\":\"<p>Recuerda que, el paquete que escogiste para publicar tu inmueble tiene visibilidad en redes sociales (a lo que se le llama publicidad segmentada) en este paso vas a poder escoger a que tipo de publico, con que caracter&iacute;sticas, intereses y hasta ubicaci&oacute;n geogr&aacute;fica quieres que les llegue la promoci&oacute;n de tu inmueble por redes sociales&nbsp;&nbsp;<\\/p>\\r\\n\\r\\n<p>O si bien te parece &Aacute;rea privada puede hacer esta segmentaci&oacute;n por ti bas&aacute;ndonos en los estudios y criterios propios de tu inmueble<\\/p>\",\"tipo\":\"6\",\"_token\":\"H9R194LqoJci4QTivTXCbvrtuNTbiw3UTJSEYZBZ\",\"_method\":\"PUT\"}','2019-09-10 13:32:28','2019-09-10 13:32:28'),(8623,2,'admin/textos','GET','186.86.195.243','{\"_pjax\":\"#pjax-container\"}','2019-09-10 13:32:54','2019-09-10 13:32:54'),(8624,2,'admin/textos/6/edit','GET','186.86.195.243','{\"_pjax\":\"#pjax-container\"}','2019-09-10 13:32:59','2019-09-10 13:32:59'),(8625,2,'admin/textos','GET','186.86.195.243','{\"_pjax\":\"#pjax-container\"}','2019-09-10 13:33:01','2019-09-10 13:33:01'),(8626,2,'admin/textos/6/edit','GET','186.86.195.243','{\"_pjax\":\"#pjax-container\"}'