inmobiliario en Latinoam&eacute;rica.<\\/p>\\r\\n\\r\\n<p>3. De acuerdo con el &uacute;ltimo informe del DANE (2017), el 34,5 % de las personas en Colombia viven en arriendo. Comprar para luego arrendar no es mala idea, &iexcl;la oferta es amplia!<\\/p>\\r\\n\\r\\n<p>4. De acuerdo con Francisco Pailli&eacute;, director de RE\\/MAX en Colombia, en nuestro pa&iacute;s se negocian &iexcl;700.000 inmuebles al a&ntilde;o! Seg&uacute;n &eacute;l, este n&uacute;mero nos revela que el mercado inmobiliario es un excelente sector para invertir.<\\/p>\\r\\n\\r\\n<p>5. El GRI Group realiz&oacute; un estudio donde encuest&oacute; a 340 empresarios del sector inmobiliario en Latinoam&eacute;rica. El 81,5 % de los empresarios esperan resultados positivos en Colombia, mientras que en el resto de pa&iacute;ses de la regi&oacute;n sus pron&oacute;sticos no son tan prometedores.<\\/p>\\r\\n\\r\\n<p>&iquest;Sabe qu&eacute; tienen en com&uacute;n estas cifras? Que todas nos permiten concluir que el sector inmobiliario tiene buena perspectiva de crecimiento en el 2019. &iquest;Qu&eacute; espera para empezar?<\\/p>\\r\\n\\r\\n<p>&nbsp;<\\/p>\",\"_token\":\"zAMZlqOgYVQWiQ363cvHrczUjFKl6PTiJY7daprB\",\"_method\":\"PUT\",\"_previous_\":\"https:\\/\\/areaprivada.co\\/admin\\/noticias\"}','2019-10-05 11:56:54','2019-10-05 11:56:54'),(10976,2,'admin/noticias','GET','190.253.157.245','[]','2019-10-05 11:56:55','2019-10-05 11:56:55'),(10977,2,'admin/destacado_home','GET','190.253.157.245','[]','2019-10-05 11:59:22','2019-10-05 11:59:22'),(10978,2,'admin/destacado_home/12','PUT','190.253.157.245','{\"ver\":\"1\",\"_token\":\"zAMZlqOgYVQWiQ363cvHrczUjFKl6PTiJY7daprB\",\"_method\":\"PUT\"}','2019-10-05 11:59:28','2019-10-05 11:59:28'),(10979,2,'admin/destacado_home/16','PUT','190.253.157.245','{\"ver\":\"0\",\"_token\":\"zAMZlqOgYVQWiQ363cvHrczUjFKl6PTiJY7daprB\",\"_method\":\"PUT\"}','2019-10-05 11:59:29','2019-10-05 11:59:29'),(10980,2,'admin/textos','GET','190.253.157.245','[]','2019-10-05 12:00: