INSERT INTO `noticias` VALUES (1,'¿No sabe en qué invertir? 5 razones para hacerlo en el sector inmobiliario','','<p>Invertir, diversificar y ahorrar son temas que seguramente le deben resonar ocasionalmente. Hoy le tenemos un tip: el mercado inmobiliario en Colombia es un nicho altamente potencial que goza de un excelente panorama. Si est&aacute; pensando en invertir para mejorar sus finanzas personales o quiere emprender un negocio, le damos cinco razones para que tome acci&oacute;n en este mercado que viene al alza.</p>\r\n\r\n<p>1. El &uacute;ltimo informe corporativo de Colliers International revel&oacute; que el mercado inmobiliario tuvo un repunte durante el &uacute;ltimo trimestre de 2018, respecto al 2017 el incremento fue del 7 %. Adem&aacute;s, el informe pronostica que continuar&aacute; en alza durante el 2019.</p>\r\n\r\n<p>2. &iquest;Sab&iacute;a usted que Bogot&aacute; es la capital que m&aacute;s arrienda en Latinoam&eacute;rica? Jorge Rovira, Gerente de Compass Group en Colombia, asegur&oacute; que la capital del pa&iacute;s se ha convertido en un atractivo para el sector inmobiliario en Latinoam&eacute;rica.</p>\r\n\r\n<p>3. De acuerdo con el &uacute;ltimo informe del DANE (2017), el 34,5 % de las personas en Colombia viven en arriendo. Comprar para luego arrendar no es mala idea, &iexcl;la oferta es amplia!</p>\r\n\r\n<p>4. De acuerdo con Francisco Pailli&eacute;, director de RE/MAX en Colombia, en nuestro pa&iacute;s se negocian &iexcl;700.000 inmuebles al a&ntilde;o! Seg&uacute;n &eacute;l, este n&uacute;mero nos revela que el mercado inmobiliario es un excelente sector para invertir.</p>\r\n\r\n<p>5. El GRI Group realiz&oacute; un estudio donde encuest&oacute; a 340 empresarios del sector inmobiliario en Latinoam&eacute;rica. El 81,5 % de los empresarios esperan resultados positivos en Colombia, mientras que en el resto de pa&iacute;ses de la regi&oacute;n sus pron&oacute;sticos no son tan prometedores.</p>\r\n\r\n<p>&iquest;Sabe qu&eacute; tienen en com&uacute;n estas cifras? Que todas nos permiten concluir que el sector inmobiliario tiene buena perspectiva de crecimiento en el 2019. &iquest;Qu&eacute; espera para empezar?</p>\r\n\r\n<p>&nbsp;</p>','images/a109b987e537bb9a42a14f9ad6a33240.jpg','[\"images\\/0b2ba33697e41293d9f43b615650a2f8.jpg\",\"images\\/7205ddce15b749f153ebfb0f4b42eb6b.jpg\",\"images\\/Roma-y-Dubai.jpg\"]','2019-08-20 19:39:19','2019-10-05 11:56:54','43457no-sabe-en-que-invertir-5-razones-para-hacerlo-en-el-sector-inmobiliario');
/*!40000 ALTER TABLE `noticias` ENABLE KEYS */;
UNLOCK TABLES;

