INSERT INTO `quienes_somos` VALUES (1,'<p>&iquest;A qui&eacute;n no le gusta estrenar? Por eso creamos &Aacute;rea Privada para que personas como t&uacute; puedan encontrar su hogar ideal, bajo la premisa de que lo que est&aacute; publicado en nuestra plataforma Web no supera los 10 a&ntilde;os de construcci&oacute;n, y si supera esos a&ntilde;os, ha sido remodelado y luce como nuevo. Encuentra fotos, videos e informaci&oacute;n abundante en los anuncios de Constructoras, Inmobiliarias, Agentes Inmobiliarios y Personas Naturales, que est&aacute;n lanzando un proyecto nuevo, vendiendo o arrendando un inmueble.&nbsp;</p>','<p>El equipo de &Aacute;rea Privada lo componemos personas con una energ&iacute;a arrolladora, nos esforzamos diariamente para atraer a las mejores Constructoras, Inmobiliarias, Agentes Inmobiliarios y Personas Naturales, para que publiquen sus inmuebles y as&iacute; m&aacute;s personas encuentren su lugar ideal para vivir.</p>\r\n\r\n<p>&nbsp;</p>','images/GRPZ5597.JPG','https://www.youtube.com/embed/81KmTbdmsVI',NULL,'2019-09-07 01:12:51');
