INSERT INTO `textos` VALUES (1,'prueba',1,NULL,NULL),(2,'<p>Para comenzar con el proceso de publicaci&oacute;n de tu inmueble es necesario completar estos primeros datos:</p>',2,NULL,'2019-09-06 14:58:28'),(3,'<p>En la publicaci&oacute;n detallada de tu inmueble, los usuarios interesados van a poder ver en el mapa la ubicaci&oacute;n exacta o cercana del inmueble, como tambi&eacute;n van a poder conocer el barrio y las calles cercanas al inmueble gracias al bot&oacute;n de street view, el cual lo mostrar&aacute; como si estuvieras caminando por ah&iacute; con im&aacute;genes reales a full color.</p>\r\n\r\n<p>Para esto necesitas ubicar dentro del mapa la gota de &Aacute;rea Privada arrastr&aacute;ndola con el mouse oprimido lo m&aacute;s cercano que puedas a la ubicaci&oacute;n real del inmueble.</p>',3,NULL,'2019-09-06 14:59:34'),(4,'<p>Ten en cuenta que entre m&aacute;s llamativa y completa sea la descripci&oacute;n e informaci&oacute;n que le des a tu inmueble, el usuario interesado por tu inmueble querr&aacute; generar el contacto que seguro te llevar&aacute; a concretar lo que esperas de tu publicaci&oacute;n.</p>',4,NULL,'2019-09-06 14:59:56'),(5,'<p>Como plus adicional para darle m&aacute;s valor a tu publicaci&oacute;n, tienes la opci&oacute;n de darle al usuario interesado las medidas de los diferentes espacios de tu inmueble, como por ejemplo; cocina, alcoba principal entre otros, esto con el fin de darle m&aacute;s detalles al usuario final y para que tambi&eacute;n pueda comparar con su inmueble actual u otras opciones que tenga, pero no te preocupes en dado caso que no cuentes con un metro a la mano, el d&iacute;a de nuestra visita para la toma de fotograf&iacute;as y video profesional, nosotros mismos ratificaremos las medidas de los espacios de inter&eacute;s.</p>\r\n\r\n<p>Si deseas hacerlo tu mismo, solo basta que hagas click en NUEVO para cargar un espacio de inter&eacute;s diferente</p>',5,NULL,'2019-09-06 15:01:23'),(6,'<p>Recuerda que, el paquete que escogiste para publicar tu inmueble tiene visibilidad en redes sociales (a lo que se le llama publicidad segmentada) en este paso vas a poder escoger a que tipo de publico, con que caracter&iacute;sticas, intereses y hasta ubicaci&oacute;n geogr&aacute;fica quieres que les llegue la promoci&oacute;n de tu inmueble por redes sociales&nbsp;&nbsp;</p>\r\n\r\n<p>O si bien te parece &Aacute;rea privada puede hacer esta segmentaci&oacute;n por ti bas&aacute;ndonos en los estudios y criterios propios de tu inmueble</p>',6,NULL,'2019-09-10 13:32:29'),(7,'',7,NULL,NULL),(8,'<p>Fotograf&iacute;as y video: Recuerda que debes mostrar muy bien el producto para lograr tus objetivos con esta publicaci&oacute;n, es por esto que nuestros paquetes incluyen la visita de uno de nuestros colaboradores para la toma de fotograf&iacute;as y videos profesionales.<br />\r\n- Solo es necesario que selecciones un d&iacute;a entre (martes a s&aacute;bado)<br />\r\n- Un horario, el que m&aacute;s te convenga.<br />\r\n- Llenar tus datos personal.<br />\r\n- Y en las siguientes 3 horas nos estaremos comunicando contigo para la confirmaci&oacute;n de la visita.</p>',8,NULL,'2019-09-10 13:29:53'),(9,'',0,NULL,NULL);
/*!40000 ALTER TABLE `textos` ENABLE KEYS */;
UNLOCK TABLES;

