INSERT INTO `ty_c_s` VALUES (1,'<p><strong>T&Eacute;RMINOS Y CONDICIONES DE USO DE PLATAFORMA &Aacute;REA PRIVADA &ldquo;GRUPO SYS S.A.S&rdquo;</strong></p>\r\n\r\n<p><strong>POR FAVOR LEA DETENIDAMENTE ESTOS T&Eacute;RMINOS Y CONDICIONES DE USO DEL APLICATIVO &Aacute;REA PRIVADA, AL ACEPTAR O UTILIZAR LA APLICACI&Oacute;N, (COMO EST&Aacute; DEFINIDO A CONTINUACI&Oacute;N), EST&Aacute; SUJETO AL CUMPLIMIENTO DE LOS T&Eacute;RMINOS Y CONDICIONES DE &Eacute;STA. SI NO EST&Aacute; DE ACUERDO CON TODOS LOS T&Eacute;RMINOS Y CONDICIONES AQU&Iacute; ESTABLECIDOS, NO ACCEDA NI HAGA USO DE PLATAFORMA. LOS T&Eacute;RMINOS EN MAY&Uacute;SCULAS NO DEFINIDOS EN ESTE DOCUMENTO TENDR&Aacute;N LA DEFINICI&Oacute;N ESTABLECIDA POR SU USO GENERAL.</strong></p>\r\n\r\n<p>Mediante su acceso y uso de los Servicios por parte de los usuarios (el &quot;Usuario&quot; o &quot;Usuarios&quot;) de plataforma AREA PRIVADA (en adelante, el &quot;AREA PRIVADA&quot;) de propiedad de la sociedad &nbsp;<strong> GRUPO SYS S.A.S</strong> (en adelante, &quot;<strong> GRUPO SYS</strong>&quot;). El Usuario acepta plena y sin reserva vincularse jur&iacute;dicamente por estos T&eacute;rminos y Condiciones, que se encuentren vigentes en el momento mismo en que accede al aplicativo AREA PRIVADA estableciendo una relaci&oacute;n contractual entre usted y GRUPO SYS. Si usted no acepta los presentes T&eacute;rminos y Condiciones, no podr&aacute; acceder o usar la aplicaci&oacute;n. Estos T&eacute;rminos y Condiciones sustituyen expresamente los acuerdos o compromisos hechos previamente con usted.</p>\r\n\r\n<p>GRUPO SYS tiene la total autonom&iacute;a de realizar cualquier cambio y/o modificaci&oacute;n respecto a la informaci&oacute;n contenida en plataforma, as&iacute; como sus t&eacute;rminos y condiciones en cualquier momento y sin necesidad de previo aviso. Las modificaciones realizadas producir&aacute;n efecto de forma inmediata a su incorporaci&oacute;n en plataforma &Aacute;REA PRIVADA. La modificaci&oacute;n inmediata de estos T&eacute;rminos y Condiciones ser&aacute; realizada cuando GRUPO SYS lo considere oportuno, o, en general, se encuentra habilitado para dejar de ofrecer o denegar el acceso cualquier usuario o cliente, al aplicativo, en cualquier momento y por cualquier motivo. Su acceso o uso continuado de la aplicaci&oacute;n &Aacute;REA PRIVADA despu&eacute;s de dicha publicaci&oacute;n constituye su consentimiento a vincularse a las modificaciones de los T&eacute;rminos y Condiciones.</p>\r\n\r\n<p>Se podr&aacute;n aplicar condiciones suplementarias a determinados Servicios, como pol&iacute;ticas para un evento, una actividad o una promoci&oacute;n particular, y dichas condiciones suplementarias ser&aacute;n comunicadas de forma clara y expresa al Usuario en relaci&oacute;n con Servicios aplicables. Las condiciones suplementarias se establecen adem&aacute;s de los T&eacute;rminos y Condiciones, y se considerar&aacute;n una parte de estas, para los fines de los Servicios aplicables. Las condiciones suplementarias prevalecer&aacute;n sobre las los T&eacute;rminos y Condiciones generales &uacute;nicamente en el caso que se llegue a presentar un conflicto respecto a los Servicios especifico de la actividad o promoci&oacute;n en particular.</p>\r\n\r\n<p>La recopilaci&oacute;n y el uso que hacemos de la informaci&oacute;n personal en relaci&oacute;n con los Servicios es conforme se dispone en la Pol&iacute;tica de privacidad de GRUPO SYS, disponible en en un link dispuesto para tal fin dentro de plataforma &Aacute;REA PRIVADA.</p>\r\n\r\n<p><strong><em>ASPECTOS GENERALES</em></strong></p>\r\n\r\n<p>&nbsp;<strong>1.&nbsp;INFORMACI&Oacute;N</strong></p>\r\n\r\n<p>&nbsp;GRUPO SYS S.A.S. es una sociedad constituida conforme a las leyes colombianas, identificada con NIT: 901.206.464 - 8, con domicilio en la ciudad de Bogot&aacute; D.C.</p>\r\n\r\n<p>&nbsp;<strong>2.&nbsp;NATURALEZA JUR&Iacute;DICA</strong></p>\r\n\r\n<p>Los presentes t&eacute;rminos y condiciones de uso regulan la relaci&oacute;n contractual de car&aacute;cter comercial entre los usuarios y clientes que acceden al Plataforma &Aacute;REA PRIVADA, por una parte, y a La GRUPO SYS, por la otra, especialmente en la autorizaci&oacute;n de uso que otorga &eacute;ste en favor de aquel.</p>\r\n\r\n<p><strong>3.&nbsp;DEFINICIONES</strong></p>\r\n\r\n<p><strong>Cookies:</strong>&nbsp;Cadenas de texto enviadas virtualmente que son almacenadas por el uso de la aplicaci&oacute;n &Aacute;REA PRIVADA&nbsp;por GRUPO SYS, para la consulta de las actividades y preferencias de los usuarios.</p>\r\n\r\n<p><strong>Comercio Electr&oacute;nico:</strong>&nbsp;Comprende el env&iacute;o, transmisi&oacute;n, recepci&oacute;n, almacenamiento de mensajes de datos por v&iacute;a electr&oacute;nica. Las dudas que surjan respecto de la eficacia y validez de los mensajes de datos y dem&aacute;s actividades vinculadas al comercio electr&oacute;nico se interpretar&aacute;n de conformidad con la ley 527 de 1999.</p>\r\n\r\n<p><strong>Usuarios: </strong>Toda persona natural o jur&iacute;dica que, como destinatario final, use plataforma &Aacute;REA PRIVADA para ver inmuebles para renta (temporal o permanente) o para compra, para organizar citas y ver dichos inmuebles, para recibir informaci&oacute;n sobre inmuebles de acuerdo a sus preferencias, ofrezcan los clientes y GRUPO SYS.</p>\r\n\r\n<p><strong>Clientes</strong>: personas naturales o jur&iacute;dicas tales como agentes inmobiliarios, constructoras, inmobiliarias o cualquier otra persona interesada en poner a disposici&oacute;n su inmueble para renta o para venta por medio de fotos o videos disponibles para los usuarios.</p>\r\n\r\n<p><strong>Cuenta de Usuario:</strong> Es el registro que hacen los usuarios y los clientes en la aplicaci&oacute;n &Aacute;REA PRIVADA para crear un perfil en el que incluyen su informaci&oacute;n personal y aceptan que tienen la capacidad para obligarse o a la persona jur&iacute;dica que representan.</p>\r\n\r\n<p><strong>Contrato de compraventa celebrado por medios electr&oacute;nicos:</strong>&nbsp;Es aquel acuerdo de voluntades celebrado entre GRUPO SYS y los clientes, por medio de la cual el cliente escoge un tipo de suscripci&oacute;n a la plataforma y a cambio de un pago obtiene un montaje fotogr&aacute;fico y de video del inmueble que pretende ofrecer por el tiempo contratado y pagado.</p>\r\n\r\n<p><strong>Datos personales:</strong>&nbsp;Es toda informaci&oacute;n de car&aacute;cter personal que permite identificar o hacer identificable a una persona natural.</p>\r\n\r\n<p><strong>Derechos de Autor y de propiedad Industrial:</strong> hace referencia a cualquier tipo de derecho de autor, marca registrada, nombre comercial o signo distintivo en general, as&iacute; como know-how (secreto Comercial), u otros derechos de propiedad intelectual, d</p>\r\n\r\n<p><strong>Eventos</strong>: ser&aacute;n parte de los Servicios que ofrece la p&aacute;gina, los cuales pueden consistir, sin limitarse a ellos, a cursos de capacitaci&oacute;n, seminarios, congresos, <em>webinars</em>, entre otros.<a href=\"#_msocom_1\" id=\"_anchor_1\" name=\"_msoanchor_1\">[EC1]</a>&nbsp;</p>\r\n\r\n<p><strong>Garant&iacute;a: </strong>GRUPO SYS act&uacute;a &uacute;nicamente como un canal de comunicaci&oacute;n entre usuarios y clientes y por tanto no puede garantizar sobre la precisi&oacute;n, exactitud, confiabilidad u oportunidad de la informaci&oacute;n o del material all&iacute; incluido. Adicionalmente GRUPO SYS no es responsable ni garante por fallas en la construcci&oacute;n o en la calidad de los inmuebles que se encuentran inscritos en la plataforma &Aacute;REA PRIVADA.</p>\r\n\r\n<p><strong>Interacci&oacute;n en la aplicaci&oacute;n &Aacute;REA PRIVADA:</strong>&nbsp;Facultad de acceso por parte de los usuarios para conocer los inmuebles exhibidos dentro de plataforma AREA PROVADA y ofrecidos por los clientes, as&iacute; como la publicidad puesta a disposici&oacute;n en la aplicaci&oacute;n.</p>\r\n\r\n<p><strong>Ley Aplicable</strong>: significa cualquier ley nacional y/o territorial, v&aacute;lida en el territorio colombiano, incluyendo, pero sin limitarse a ellas, normas tributarias; de privacidad y leyes de protecci&oacute;n de datos; legislaci&oacute;n para la prevenci&oacute;n del lavado de activos y la financiaci&oacute;n del terrorismo; de protecci&oacute;n de los derechos de autor y de la propiedad industrial; leyes de comercio electr&oacute;nico.</p>\r\n\r\n<p><strong>Mensajes de datos:</strong>&nbsp;La informaci&oacute;n generada, enviada, recibida, almacenada o comunicada por medios electr&oacute;nicos, &oacute;pticos o similares, como pudieran ser, entre otros, el Intercambio Electr&oacute;nico de Datos (EDI), Internet, el correo electr&oacute;nico, el telegrama, el t&eacute;lex o el telefax.</p>\r\n\r\n<p>&nbsp;<strong>Operador de la aplicaci&oacute;n &Aacute;REA PRIVADA:</strong>&nbsp;Encargado de administrar operativamente y funcionalmente la aplicaci&oacute;n &Aacute;REA PRIVADA representado para los efectos de los presentes t&eacute;rminos por GRUPO SYS S.A.S., o por la persona natural o jur&iacute;dica que &eacute;sta designe.</p>\r\n\r\n<p>&nbsp;<strong>Pasarela de pagos:</strong>&nbsp;Servicio que permite la realizaci&oacute;n de pagos por parte de los Clientes directamente a GRUPO SYS a trav&eacute;s de medios electr&oacute;nicos utilizando plataformas como PAYU, dentro de plataforma &Aacute;REA PRIVADA</p>\r\n\r\n<p>&nbsp;<strong>Plataforma &Aacute;REA PRIVADA:</strong>&nbsp;Aplicativo m&oacute;vil administrado por GRUPO SYS que permite la concurrencia en un mercado de oferentes y demandantes, para la celebraci&oacute;n de negocios jur&iacute;dicos determinados.</p>\r\n\r\n<p>&nbsp;<strong>Publicidad:</strong>&nbsp;Es toda forma de comunicaci&oacute;n realizada por GRUPO SYS, con el fin de brindar informaci&oacute;n sobre inmuebles, actividades comerciales y comunicar estrategias o campa&ntilde;as publicitarias o de mercadeo, propias o de terceros; realizada como mecanismo de referencia y no como oferta p&uacute;blica.</p>\r\n\r\n<p><strong>Clientes:</strong> Son las personas naturales o jur&iacute;dicas que re&uacute;nen las condiciones establecidas en el numeral 11 del art&iacute;culo 5 de la ley 1480 de 2011, esto es, quienes comercializan directa o indirectamente inmuebles a trav&eacute;s de la aplicaci&oacute;n &Aacute;REA PRIVADA. Los clientes aceptan con la exhibici&oacute;n de los inmuebles que son los encargados de otorgar las respectivas garant&iacute;as de calidad de los mismos ante los Consumidores.</p>\r\n\r\n<p><strong>Servicios:</strong> son las actividades y dem&aacute;s servicios ofrecidos a trav&eacute;s de la aplicaci&oacute;n &Aacute;REA PRIVADA que no son considerados Productos. Pueden consistir, entre otros, en Eventos.</p>\r\n\r\n<p><strong>T&eacute;rminos y Condiciones:</strong>&nbsp;Constituyen los t&eacute;rminos que han de regular el uso de los clientes y usuarios en la aplicaci&oacute;n &Aacute;REA PRIVADA.</p>\r\n\r\n<p>&nbsp;<strong>4.&nbsp;OBJETO</strong></p>\r\n\r\n<p>Los presentes T&eacute;rminos y Condiciones regulan la autorizaci&oacute;n de uso que otorga GRUPO SYS a los clientes, para que ingresen a la aplicaci&oacute;n &Aacute;REA PRIVADA, suban informaci&oacute;n, fotos y videos sobre inmuebles, para que sean utilizados como referencia por los usuarios y as&iacute; puedan entablar una comunicaci&oacute;n con el fin a que esas dos partes lleguen a un acuerdo comercial.</p>\r\n\r\n<p>Adicionalmente, GRUPO SYS autoriza a los usuarios, para que ingresen a plataforma &Aacute;REA PRIVADA, se informen sobre los inmuebles exhibidos, para que puedan comunicarse de forma directa con el vendedor o arrendador y as&iacute; entablen una comunicaci&oacute;n que los pueda llevar a la realizaci&oacute;n de un acuerdo comercial entre ellos.</p>\r\n\r\n<p>GRUPO SYS a trav&eacute;s de la aplicaci&oacute;n &Aacute;REA PRIVADA realiza las siguientes acciones:&nbsp;<strong><em>i)</em></strong>&nbsp;exhibe diferentes inmuebles para renta o para compra. <strong><em>ii)</em></strong> exhibe informaci&oacute;n publicitaria que pueden ser de inter&eacute;s para el usuario que pretende adquirir un inmueble<em>,</em>&nbsp;<strong><em>iii)</em></strong>&nbsp;permite el uso de la aplicaci&oacute;n &Aacute;REA PRIVADA para la realizaci&oacute;n de pagos por parte de los clientes a trav&eacute;s de la plataforma PAYU, &eacute;ste proceso implica un v&iacute;nculo con GRUPO SYS&nbsp;<strong><em>iv)</em></strong>&nbsp;sirve de medio de env&iacute;o de comunicaciones entre los clientes y los usuarios.</p>\r\n\r\n<p>A trav&eacute;s de la aplicaci&oacute;n &Aacute;REA PRIVADA los clientes eligen un tipo de plan que permite una mantener exhibidos una cierta cantidad de inmuebles por un cierto periodo de tiempo con el fin que usuarios interesados se comuniquen para adquirir dichos inmuebles. Para acceder a los diferentes planes ofrecidos por &Aacute;REA PRIVADA el cliente debe realizar un pago a trav&eacute;s de la plataforma de pagos PAY U.</p>\r\n\r\n<p>Posterior a la inscripci&oacute;n en la plataforma para la exhibici&oacute;n de su inmueble, debe contratar el servicio de fotograf&iacute;a y video que presta AREA PRIVADA. Para adquirir dicho servicio se debe concretar una fecha y realizar el pago de la tarifa correspondiente mediante la plataforma PAY U. En caso de que el fot&oacute;grafo llegue a la hora y lugar se&ntilde;alado y no se encuentre el responsable para realizar la toma de fotos y videos, se dar&aacute; un tiempo de espera de 15 minutos, si en ese periodo de tiempo no aparece el responsable, el Cliente deber&aacute; solicitar una nueva cita por medio de la plataforma y realizar un nuevo pago por la plataforma PAYU.</p>\r\n\r\n<p>Los usuarios pueden acceder a la plataforma creando un perfil con sus datos personales de conformidad a lo establecido en la pol&iacute;tica de privacidad establecida por GRUPO SYS, sin realizar ning&uacute;n tipo de pago y obtener la informaci&oacute;n de los diferentes inmuebles exhibidos de conformidad Asus preferencias y requisitos.</p>\r\n\r\n<p>&nbsp;5. <strong>DERECHOS DE PROPIEDAD INDUSTRIAL E INTELECTUAL</strong></p>\r\n\r\n<p>La marca AREA PRIVADA, los videos, fotograf&iacute;as nombre comercial, logos o cualquier cosa que haga alusi&oacute;n a AREA PRIVADA o cualquier otro producto o servicio del GRUPO SYS son de su titularidad.</p>\r\n\r\n<p>Las marcas, avisos, nombres comerciales, propaganda comercial, que aparecen en Plataforma &Aacute;REA PRIVADA, y no son de propiedad exclusiva de GRUPO SYS, est&aacute;n siendo usadas con autorizaci&oacute;n de su titular. GRUPO SYS no se hace responsable por la violaci&oacute;n a la propiedad industrial que cualquiera de sus clientes haga sobre signos distintivos o derechos de autor de terceros, no obstante, en caso de queja o reclamo de tercero se compromete a informar al infractor de la situaci&oacute;n de forma inmediata.</p>\r\n\r\n<p>Est&aacute; prohibido cualquier uso o explotaci&oacute;n de cualquier forma o por cualquier medio, sin el consentimiento previo y por escrito de GRUPO SYS, de cualquier contenido incluido en plataforma &Aacute;REA PRIVADA. El dise&ntilde;o y contenido de plataforma &Aacute;REA PRIVADA se encuentra protegido de conformidad con lo establecido por las normas nacionales e internacionales de protecci&oacute;n de la Propiedad Industrial y del Derecho de Autor, quedando prohibido: modificar, copiar, distribuir, transmitir, desplegar, publicar, editar, vender, o de cualquier forma explotar el dise&ntilde;o y contenido dentro de plataforma &Aacute;REA PRIVADA.</p>\r\n\r\n<p>Adicionalmente los videos y fotos que se exhiben en la p&aacute;gina AREA PRIVADA son de su titularidad exclusiva y por tanto su uso por terceros debe contar con una autorizaci&oacute;n expresa.</p>\r\n\r\n<p>El software, los c&oacute;digos fuente y en general el programa de ordenador que constituye y soporta la p&aacute;gina, tienen protecci&oacute;n de Derechos de Autor de acuerdo con la legislaci&oacute;n nacional y con normas internacionales y son de propiedad exclusiva de GRUPO SYS.</p>\r\n\r\n<p><strong>6.&nbsp;PLATAFORMA &Aacute;REA PRIVADA TECNOL&Oacute;GICA QUE PERMITE SU USO</strong></p>\r\n\r\n<p>Es una plataforma &Aacute;REA PRIVADA que permite su uso&nbsp;gratuito&nbsp;mediante descargar en dispositivos m&oacute;viles por medio de tiendas virtuales de aplicaciones&nbsp;de Apple y de Google&nbsp;(App Store de Apple, Google Play&nbsp;de Google). Los Consumidores podr&aacute;n utilizar la aplicaci&oacute;n &Aacute;REA PRIVADA exclusivamente para su uso personal, sin que esto implique el otorgamiento de una licencia del aplicativo de ning&uacute;n tipo.</p>\r\n\r\n<p>&nbsp;<strong>7.&nbsp;MODIFICACI&Oacute;N</strong></p>\r\n\r\n<p>Es responsabilidad del usuario verificar regularmente la p&aacute;gina puesto que el uso continuado de la misma una vez se realicen los cambios se asume como la aceptaci&oacute;n de los mismos, eliminando la posibilidad de cualquier reclamo posterior que se pueda generar por el uso de la aplicaci&oacute;n &Aacute;REA PRIVADA</p>\r\n\r\n<p><strong><em>DETALLE DEL SERVICIO</em></strong></p>\r\n\r\n<p>&nbsp;<strong>8.&nbsp;USUARIO</strong></p>\r\n\r\n<p>Toda persona natural o jur&iacute;dica que, como destinatario final, use la aplicaci&oacute;n &Aacute;REA PRIVADA para adquirir inmuebles que ofrezcan los Clientes.</p>\r\n\r\n<p>Los servicios y precios incluidos en plataforma &Aacute;REA PRIVADA est&aacute;n dirigidos al p&uacute;blico en general como personas indeterminadas, y por consiguiente el uso de la misma no implica un costo alguno.</p>\r\n\r\n<p>El uso de la aplicaci&oacute;n &Aacute;REA PRIVADA lo realiza el usuario como sujeto con plena capacidad legal para asumir los derechos y obligaciones, como parte del contrato de prestaci&oacute;n de servicios electr&oacute;nicos en las calidades que refrenda al momento de generar su registro.</p>\r\n\r\n<p>En el caso de las personas jur&iacute;dicas, al momento de registrarse declaran que tienen la capacidad jur&iacute;dica o legal para obligar a la persona jur&iacute;dica que representan sin ning&uacute;n tipo de limitaci&oacute;n o prohibici&oacute;n para las compras o adquisici&oacute;n de servicios.&nbsp;</p>\r\n\r\n<p><strong>9.&nbsp;CLIENTES</strong></p>\r\n\r\n<p>Personas naturales o jur&iacute;dicas que, de manera habitual,&nbsp;teniendo&nbsp;capacidad&nbsp;de contrataci&oacute;n, acceden a la aplicaci&oacute;n &Aacute;REA PRIVADA para ofrecer y inmuebles a los clientes a cambio de un pago de conformidad a un plan escogido previamente. Las calidades de los Clientes se encuentran establecidas en el numeral 11 del art&iacute;culo 5 de la ley 1480 de 2011 en calidad de Proveedores. Estos clientes son conocidos como</p>\r\n\r\n<ul>\r\n	<li>Empresas inmobiliarias</li>\r\n	<li>Personas naturales</li>\r\n	<li>Agentes inmobiliarios</li>\r\n	<li>Constructoras</li>\r\n</ul>\r\n\r\n<p>Los clientes autorizan a que &Aacute;REA PRIVADA tome fotos y videos de los inmuebles que se ponen a disposici&oacute;n de los USUARIOS. Para la toma de las fotos y videos se agendar&aacute; una cita de lunes a viernes en horario de 8: 00 am a 6:00 pm, en caso que el cliente incumpla la cita, se deber&aacute; agendar una nueva cita pagando el costo adicional que esta genera.</p>\r\n\r\n<p>Adicionalmente el cliente autoriza a que &Aacute;REA Privada use dichas fotos y videos en plataformas y redes sociales, banners, propaganda POP, flyers y dem&aacute;s medios digitales o an&aacute;logos que considere necesarios como medio de propaganda por los servicios que presta, as&iacute; como la informaci&oacute;n del contacto del inmueble y las caracter&iacute;sticas del mismo.</p>\r\n\r\n<p><strong>9.1. Condiciones de los inmuebles</strong></p>\r\n\r\n<p>&Aacute;REA PRIVADA no se hace responsable de las condiciones en que se encuentra el inmueble, no obstante, para que el cliente pueda ingresar su inmueble a la plataforma debe cumplir con las m&iacute;nimas condiciones de:</p>\r\n\r\n<ul>\r\n	<li>M&aacute;ximo 30 a&ntilde;os de construcci&oacute;n del inmueble</li>\r\n	<li>Si el inmueble cuenta con remodelaciones puede contar con m&aacute;s de 10 a&ntilde;os de construcci&oacute;n si sobrepasar los 30 a&ntilde;os de construido</li>\r\n	<li>Incluir los precios de administraci&oacute;n en caso de arriendos a largo plazo y venta.</li>\r\n	<li>En el caso de arriendo temporal, el precio final que se establece en la plataforma debe incluir los gastos de servicios p&uacute;blicos como los gastos de administraci&oacute;n. No puede el arrendatario solicitar cobros adicionales a los enunciados en la plataforma.</li>\r\n</ul>\r\n\r\n<p><strong>10.&nbsp;CUENTA DE USUARIO</strong></p>\r\n\r\n<p>Los usuarios usan&nbsp;como referencia los inmuebles exhibidos junto con la informaci&oacute;n suministrada de los mismos en la aplicaci&oacute;n &Aacute;REA PRIVADA,&nbsp;teniendo como&nbsp;condici&oacute;n necesaria la creaci&oacute;n de una&nbsp;Cuenta de Usuario,&nbsp;donde se solicitar&aacute;n datos personales, tales como nombre y/o raz&oacute;n social, identificaci&oacute;n, fecha de nacimiento, tel&eacute;fono, correo electr&oacute;nico; esta informaci&oacute;n se utiliza para la plena identificaci&oacute;n de los Usuarios, para la prevenci&oacute;n de fraudes, para vincular a los usuarios con GRUPO SYS y/o el Cliente y en general para los fines definidos en el ac&aacute;pite&nbsp;de Manejo de informaci&oacute;n.</p>\r\n\r\n<p>El uso de la Cuenta de Usuario es personal e intransferible, por lo cual los usuarios no se encuentran facultados para ceder los datos de validaci&oacute;n para el acceso a la aplicaci&oacute;n &Aacute;REA PRIVADA. En caso de olvido de los datos de validaci&oacute;n o de usurpaci&oacute;n de &eacute;stos, es obligaci&oacute;n de los usuarios informarlo a GRUPO SYS a trav&eacute;s de la opci&oacute;n &ldquo;olvid&oacute; su contrase&ntilde;a&rdquo;&nbsp;o a trav&eacute;s de comunicaci&oacute;n enviada al correo electr&oacute;nico servicioalcliente@areaprivada.co.</p>\r\n\r\n<p>La Cuentas de Usuarios ser&aacute;n administradas por GRUPO SYS o por la persona que &eacute;ste designe, teniendo plena facultad para cerrar o bloquear cualquiera de &eacute;stas, cuando la informaci&oacute;n suministrada por el usuario no sea veraz, completa o segura; o cuando se presente incumplimiento de las obligaciones de los usuarios. En ning&uacute;n momento GRUPO SYS solicitar&aacute; a los usuarios informaci&oacute;n que NO resulte necesaria para su vinculaci&oacute;n con GRUPO SYS y/o el cliente,</p>\r\n\r\n<p>Lo anterior aplica de igual forma para los Clientes, no obstante en este caso se solicita informaci&oacute;n bancaria ya que se genera un pago, por lo tanto los datos de tarjetas d&eacute;bito o cr&eacute;dito, solo se solicitar&aacute;n al momento de realizar el pago virtual si as&iacute; lo define los Clientes, &eacute;stos datos no ser&aacute;n almacenados por GRUPO SYS, ser&aacute;n inscritos directamente en la Pasarela de Pagos &ldquo;ePayco&rdquo;, y&nbsp;se utilizar&aacute;n directamente por los clientes&nbsp;en &eacute;sta, donde se informar&aacute;n las condiciones de seguridad y privacidad en que se efect&uacute;a el mismo.</p>\r\n\r\n<p>Con la creaci&oacute;n de la Cuenta de Usuario, tanto los usuarios como los clientes est&aacute;n manifestando su voluntad de aceptaci&oacute;n expresa e inequ&iacute;voca de los presentes T&eacute;rminos y Condiciones de uso de la plataforma &Aacute;REA PRIVADA.</p>\r\n\r\n<p><strong>Par&aacute;grafo.</strong>&nbsp;Los Clientes y usuarios autorizan expresamente, al momento de la aceptaci&oacute;n de los presentes T&eacute;rminos,&nbsp;el uso de Cookies por parte de GRUPO SYS en toda actividad de uso que realice de la Plataforma &Aacute;REA PRIVADA.</p>\r\n\r\n<p><strong>11. PROTECCION DE DATOS PERSONALES</strong></p>\r\n\r\n<p>GRUPO SYS es consciente de las implicaciones del Tratamiento de Datos Personales, por ello efect&uacute;a dicha actividad conforme a los principios y directrices contenidas en el Estatuto para la de Protecci&oacute;n de Datos Personales - Ley 1581 de 2012, los Decretos que lo reglamentan y la gu&iacute;a para la implementaci&oacute;n del principio de responsabilidad demostrada de la Superintendencia de Industria y Comercio.</p>\r\n\r\n<p>Dentro de la pol&iacute;tica de privacidad del GRUPO SYS se encuentran los datos a recolectar, las finalidades de uso, mecanismos de protecci&oacute;n, derechos y deberes de los titulares del dato, as&iacute; como el procedimiento de modificaci&oacute;n, queja o supresi&oacute;n de los datos.</p>\r\n\r\n<p><strong>12. TRATAMIENTO DE DATOS PERSONALES PARA REDES SOCIALES</strong></p>\r\n\r\n<p>Los CLIENTES y los USUARIOS al aceptar los presentes TERMINOS Y CONDICIONES acceden a que la informaci&oacute;n personal como nombre, documento de identificaci&oacute;n, numero de contacto y correo electr&oacute;nico sean puestos a disposici&oacute;n de las diferentes redes sociales como FACEBOOK e INSTAGRAM entre otros, para que sean contactados con el fin de generar un posible negocio o venta.</p>\r\n\r\n<p>Los datos personales anteriormente enlistados ser&aacute;n recolectados por medio de un formulario y puestos a disposici&oacute;n &uacute;nicamente de quien est&eacute; interesado en generar un contacto real para agendar una visita o para conocer m&aacute;s de un proyecto inmobiliario o detalles del inmueble anunciado en la publicaci&oacute;n.</p>\r\n\r\n<p>&nbsp;<strong>13. </strong><strong>OPCI&Oacute;N DE PAGO</strong></p>\r\n\r\n<p>GRUPO SYS ofrece a sus clientes la opci&oacute;n de pago de la factura de los servicios a trav&eacute;s del servicio Pasarela de Pagos &ldquo;ePayco&rdquo;.</p>\r\n\r\n<p>GRUPO SYS no se hace responsable de las razones por las cuales no se autorice la transacci&oacute;n de pago, ni por las inconsistencias en el mismo, ni est&aacute; obligada a informarlas al cliente en los casos que se presente. El Usuario tiene la completa responsabilidad de verificar con su entidad bancaria cualquier tipo de problema o inconveniente que se le presente en el momento de realizar el pago. GRUPO SYS solo entender&aacute; que el pago fue realizado en el momento en que reciba la verificaci&oacute;n bancaria de aprobaci&oacute;n del mismo.</p>\r\n\r\n<p>El pago de las facturas de los servicios se realiza mediante sitios con conexi&oacute;n segura (SSL). Sin perjuicio de lo anterior, el cliente acepta conocer los riesgos que se tienen en este tipo de transacci&oacute;n y por lo tanto declara indemne y libre de toda responsabilidad a GRUPO SYS.</p>\r\n\r\n<p><strong>14.&nbsp;CAPACIDAD</strong></p>\r\n\r\n<p>Es claro para el Cliente que la relaci&oacute;n contractual que se puede llegar a generar por el uso de la Plataforma &Aacute;REA PRIVADA ser&aacute; directamente con GRUPO SYS, y consistir&aacute; en un contrato de prestaci&oacute;n de un servicio celebrado por medios electr&oacute;nicos, en el cual el Cliente es quien solicita el servicio de exhibici&oacute;n de su &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; inmueble, as&iacute; como de la toma de fotograf&iacute;as y videos y GRUPO SYS es el prestador de ese Servicios por, a trav&eacute;s de la Plataforma &Aacute;REA PRIVADA.</p>\r\n\r\n<p>En virtud de las condiciones de capacidad legal establecidas en el C&oacute;digo Civil Colombiano, C&oacute;digo de Comercio y de la validez de la manifestaci&oacute;n de voluntad a trav&eacute;s de medios electr&oacute;nicos establecida en la ley 527 de 1999, los Clientes y usuarios al momento de la creaci&oacute;n de la Cuenta de Usuario, manifiestan expresamente ser mayor de edad en caso de ser persona natural y tener capacidad para celebrar el tipo de transacciones que se pueden realizar usando la Plataforma &Aacute;REA PRIVADA, sea como persona natural o jur&iacute;dica (representaci&oacute;n legal).</p>\r\n\r\n<p>&nbsp;<strong>15.&nbsp;DESCRIPCI&Oacute;N DEL SERVICIO</strong></p>\r\n\r\n<p>GRUPO SYS exhibe a trav&eacute;s de la Plataforma &Aacute;REA PRIVADA inmuebles para la compra o para la renta en la ciudad de Bogot&aacute; D.C., que est&aacute;n a disposici&oacute;n de los usuarios para su conocimiento general o su adquisici&oacute;n de conformidad con sus preferencias. dicha plataforma servir&aacute; tanto como medio de comunicaci&oacute;n directa entre usuario y cliente, as&iacute; como para intercambio de informaci&oacute;n y posterior comunicaci&oacute;n por otros medios ajenos a la plataforma de los clientes y usuarios.</p>\r\n\r\n<p>Para el proceso de compra de cualquiera de los planes ofrecidos por &Aacute;REA PRIVADA, los clientes deben estar plenamente identificados en su Cuenta de Usuario y seguir el siguiente procedimiento:</p>\r\n\r\n<ol>\r\n	<li>Seleccionar el tipo de plan que quiere adquirir. Los planes son los siguientes:\r\n	<ol>\r\n		<li>Para personas naturales habr&aacute; paquetes categorizados como Diamante (el inmueble se publicar&aacute; durante120 d&iacute;as en la plataforma), Oro (el inmueble se publicar&aacute; durante 90 d&iacute;as en la plataforma), Plata (el inmueble se publicar&aacute; durante 60 d&iacute;as en la plataforma), Bronce (el inmueble se publicar&aacute; durante 60 d&iacute;as en la plataforma) y gratuito (el inmueble se publicar&aacute; durante30 d&iacute;as en la plataforma). Los planes se diferenciar&aacute;n por las caracter&iacute;sticas de cada uno y en consecuencia por su precio.</li>\r\n		<li>Para los AII&acute;S (Agentes inmobiliarios independientes) se ofrecer&aacute;n membres&iacute;as categorizadas bajo los nombres de: Membres&iacute;a 1, Membres&iacute;a 2, Membres&iacute;a 3, Membres&iacute;a 4 y Membres&iacute;a 5. Cada una se diferenciar&aacute; de la otra por el n&uacute;mero de inmuebles permitidos a publicar durante un periodo de 3 meses, y en consecuencia por su precio.</li>\r\n		<li>Para las constructoras y los Arriendos temporales, se manejar&aacute;n membres&iacute;as categorizadas bajo los nombres de Membres&iacute;a 2 meses, Membres&iacute;a 4 meses, Membres&iacute;a 6 meses y Membres&iacute;a 1 a&ntilde;o, las cuales como su nombre lo dice, se diferenciar&aacute;n por el tiempo de permanencia en la p&aacute;gina web y en consecuencia por su precio. Cabe resaltar, que estas membres&iacute;as cuentan con las mismas caracter&iacute;sticas todas.</li>\r\n	</ol>\r\n	</li>\r\n	<li><strong>Valor</strong>. Una vez se han agotado los pasos precedentes, se pone a disposici&oacute;n de los Clientes el valor total a pagar por <a href=\"#_msocom_2\" id=\"_anchor_2\" name=\"_msoanchor_2\">[EC2]</a>&nbsp;el plan seleccionados, el cual se encuentra discriminado unitariamente. El valor corresponder&aacute; al valor total del plan incluyendo los costos de transacci&oacute;n&nbsp;e impuestos.</li>\r\n	<li><strong>Pago</strong>. El pago que realiza el cliente lo realiza directamente a GRUPO SYS.</li>\r\n	<li><strong>Forma de pago</strong>. El Consumidor deber&aacute; seleccionar el medio de pago que desea utilizar, teniendo como posibilidades el&nbsp;pago por medio de&nbsp;pago electr&oacute;nico&nbsp;a trav&eacute;s de la plataforma de pago ePayco, disponible en plataforma de &Aacute;REA PRIVADA</li>\r\n	<li><strong>Registro</strong>. Al momento de definir la forma de pago, el Consumidor deber&aacute; crear su cuenta personal en la cual se requerir&aacute;n los datos personales que permitan su identificaci&oacute;n, m&aacute;s no su individualizaci&oacute;n, adem&aacute;s de los datos para la realizaci&oacute;n del pago a trav&eacute;s del medio electr&oacute;nico.</li>\r\n	<li><strong>Resumen y Correo electr&oacute;nico</strong>. Una vez completados los pasos anteriores se le exhibir&aacute; a trav&eacute;s de una ventana emergente al Consumidor un resumen detallado de la transacci&oacute;n indicando que ha aceptado su oferta y con el cual se celebra el contrato de prestaci&oacute;n de servicios electr&oacute;nicos; dicho resumen ser&aacute; enviado por correo electr&oacute;nico al Consumidor con esta informaci&oacute;n de forma detallada. &nbsp;</li>\r\n	<li><strong>Factura</strong>.&nbsp;En todo caso, se enviar&aacute; v&iacute;a correo electr&oacute;nico la factura con el detalle de la transacci&oacute;n con un plazo de tres (3) d&iacute;as h&aacute;biles,</li>\r\n	<li>&nbsp;En caso de haberse facturado cargos que no hubiesen correspondido, el Usuario deber&aacute; comunicarse con nuestro equipo de Atenci&oacute;n al Cliente para resolver dicha cuesti&oacute;n.</li>\r\n	<li><strong>Cumplimiento del contrato</strong>. Verificados todos los datos correspondientes a la transacci&oacute;n &Aacute;REA PRIVADA proceder&aacute; a realizar las publicaciones de los inmuebles correspondientes con las caracter&iacute;sticas e informaci&oacute;n suministrada por el cliente de conformidad al plan adquirido. En caso de no poderse realizar la publicaci&oacute;n por razones imputables al Cliente, deber&aacute; GRUPO SYS dejar constancia de este hecho.</li>\r\n</ol>\r\n\r\n<p><strong>16.&nbsp;DEBERES DE LOS CLIENTES Y USUARIOS</strong></p>\r\n\r\n<p>Con la aceptaci&oacute;n de los presentes T&eacute;rminos y Condiciones el &nbsp;cliente y el usuario se obliga a: (1) Suministrar la informaci&oacute;n veraz, confiable y fidedigna al momento de crear su Cuenta de Usuario; (2) Abstenerse de transferir a terceros los datos personales de validaci&oacute;n (nombre de usuario para la Cuenta de Usuario y contrase&ntilde;a); (3) Abstenerse de utilizar la Plataforma &Aacute;REA PRIVADA para realizar actos ilegales o contrarios a la moral, el orden p&uacute;blico y buenas costumbres en contra de GRUPO SYS, los Proveedores o de terceros; (4) Pagar oportunamente a GRUPO SYS la contraprestaci&oacute;n econ&oacute;mica definida en el proceso de prestaci&oacute;n de cualquier servicio; (5) Informar inmediatamente a GRUPO SYS en caso de olvido o usurpaci&oacute;n de los datos de validaci&oacute;n; (6) Abstenerse de realizar conductas atentatorias del funcionamiento de la Plataforma &Aacute;REA PRIVADA; (7) Abstenerse de suplantar la identidad de otros Consumidores; (8) Abstenerse de descifrar, descompilar o desensamblar cualquier elemento de la Plataforma &Aacute;REA PRIVADA o de cualquiera de sus partes; (9) Habilitar la utilizaci&oacute;n de&nbsp;Ventanas emergentes durante la operaci&oacute;n; (10) hacer uso sin autorizaci&oacute;n previa y escrita de cualquier signo distintivo propio de GRUPO SYS o de terceros que han brindado su autorizaci&oacute;n para ser mostrados en plataforma &Aacute;REA PRIVADA sin autorizaci&oacute;n previa (11) En general todas aquellas conductas necesarias para la ejecuci&oacute;n del negocio jur&iacute;dico.</p>\r\n\r\n<p>El usuario tiene prohibido lo siguiente: (1) editar, modificar, suprimir o agregar cualquier tipo de contenido material en especial si este es difamatorio, racista, obsceno, amenazador, de contenido pornogr&aacute;fico o que presente cualquier forma de ilegalidad en general o que afecte la imagen de GRUPO SYS, sus proveedores, trabajadores, directivos o terceros en general. As&iacute; como a cambiar el significado o apariencia del contenido total o parcial de la P&aacute;gina Web (2) extraer de forma total o parcial cualquier contenido protegido bajo las normas de propiedad intelectual y derechos de autor para uso diferente al personal y privado (3) Hacer uso de la P&aacute;gina Web&nbsp; para copiar, almacenar, acoger, transmitir, enviar, usar, publicar o distribuir cualquier tipo de material que consista o est&eacute; relacionado a cualquier tipo de spyware, virus de computadora, caballos de troya, gusanos, archivador de digitaci&oacute;n de teclados, rootkit o cualquier software malicioso, (4) Republicar cualquier contenido total o parcial de la P&aacute;gina Web ya sea por medios electr&oacute;nicos conocidos o por conocer o por medios f&iacute;sicos (5) Recolectar cualquier tipo de datos personales protegidos por la ley a nombre de GRUPO SYS de personas naturales o jur&iacute;dicas, (6) Usar la P&aacute;gina Web para enviar informaci&oacute;n, invitaciones, promociones sin autorizaci&oacute;n previa y escrita por parte de los titulares con cuentas activas o desactivadas, (7) Hacer uso de la plataforma &Aacute;REA PRIVADA o su contenido total o parcial para fines comerciales o lucrativos, sin autorizaci&oacute;n previa y escrita por parte de GRUPO SYS directamente, no siendo v&aacute;lida la autorizaci&oacute;n de proveedores o terceros con vinculaci&oacute;n directa o indirecta con plataforma &Aacute;REA PRIVADA o GRUPO SYS (8) Hacer uso de la p&aacute;gina o su contenido para difamar, desacreditar, calumniar o afectar el nombre de GRUPO SYS, sus proveedores o cualquiera de sus empleados o directivos, (9) Vender, alquilar o sub-licenciar cualquier contenido total o parcial que se encuentre en plataforma &Aacute;REA PRIVADA sin autorizaci&oacute;n previa y escrita realizada directamente con GRUPO SYS, (10) Mostrar cualquier contenido total o parcial de la Pagina y/o Plataforma &Aacute;REA PRIVADA en p&uacute;blico sin autorizaci&oacute;n previa y escrita de GRUPO SYS, (11) Violar con o sin intenci&oacute;n alguna la ley local, estatal, nacional o internacional aplicable y cualquier otra regulaci&oacute;n nacional.</p>\r\n\r\n<p>&nbsp;<strong>17.&nbsp;DEBERES DE GRUPO SYS</strong></p>\r\n\r\n<p>&nbsp;En virtud de los presentes t&eacute;rminos GRUPO SYS, se obliga a (1) Suministrar informaci&oacute;n tal cual fue entregada por el cliente, sin modificaci&oacute;n o alteraci&oacute;n de los inmuebles que exhibe; (2) Indicar las caracter&iacute;sticas&nbsp;generales de los inmuebles para que sirvan de referencia a los usuarios, para el efecto son informaci&oacute;n general y fotograf&iacute;as; (3) Informar suficientemente sobre los medios habilitados para que los Clientes realicen el pago; (4) Enviar al correo electr&oacute;nico suministrado por el Cliente constancia de la transacci&oacute;n; (5) Poner a disposici&oacute;n de los clientes y usuarios los t&eacute;rminos y condiciones de uso de la plataforma &Aacute;REA PRIVADA de forma actualizada; (6) Utilizar la informaci&oacute;n &uacute;nicamente para los fines establecidos en los presentes t&eacute;rminos; (7) Utilizar mecanismos de informaci&oacute;n y validaci&oacute;n durante la transacci&oacute;n como Ventanas emergentes (Pop Ups), que permitan al Consumidor aceptar o no cada paso del proceso de compra, (8), Suprimir, actualizar o modificar los datos personales del usuario en el momento y dentro del t&eacute;rmino establecido por la ley, (9) dar cumplimiento a la garant&iacute;a legal establecida por la ley, (10) informar y tener establecidos los canales de comunicaci&oacute;n con el usuario para resolver todo los temas de PQR que lleguen a su conocimiento ya sea de forma directa por el usuario as&iacute; como por medio de un intermediario, (11) Informar suficientemente sobre los medios habilitados para los usuarios y clientes se comuniquen entre s&iacute;.</p>\r\n\r\n<p><strong>18. CONTENIDO E INFORMACI&Oacute;N DE LA P&Aacute;GINA.</strong></p>\r\n\r\n<p>Toda la informaci&oacute;n suministrada en la Plataforma &Aacute;REA PRIVADA es netamente orientativa y todo el contenido es solamente informativo. GRUPO SYS no se hace responsable por decisiones o conclusiones a las que puede llegar el consumidor con base en la informaci&oacute;n publicada o suministrada en plataforma &Aacute;REA PRIVADA.</p>\r\n\r\n<p>Las fotograf&iacute;as que se publican en cada inmueble y cada una de las pesta&ntilde;as de los diferentes inmuebles son netamente orientativas. GRUPO SYS no garantiza que el inmueble visitado, adquirido o rentado por el usuario sean id&eacute;nticos a los publicados en plataforma &Aacute;REA PRIVADA. Los colores, tama&ntilde;os y especificaciones mostradas en fotograf&iacute;a son simples muestras presentadas a El usuario sin que constituyan obligaci&oacute;n para GRUPO SYS de disponer, de inmuebles id&eacute;nticos a los mostrados en fotograf&iacute;as, ya que depende de los clientes y lo que realmente poseen.</p>\r\n\r\n<p>La plataforma contendr&aacute; publicidad de empresas aliadas o con v&iacute;nculos comerciales del GRUPO SYS en forma de banners o ventanas POP.</p>\r\n\r\n<p><strong>19. GARANT&Iacute;A</strong></p>\r\n\r\n<p>&nbsp;Entiende y acepta el usuario que la plataforma AREA PRIOVADA es &uacute;nicamente un canal de comunicaci&oacute;n y exhibici&oacute;n de inmuebles y por tanto no puede hacerse garante de la calidad o veracidad de lo que se exhibe en la plataforma.</p>\r\n\r\n<p>En caso que el usuario tenga una petici&oacute;n, queja o reclamo por el funcionamiento de la plataforma podr&aacute; remitir un correo electr&oacute;nico a servicioalcliente@areaprivada.co el cual tendr&aacute; una respuesta en el t&eacute;rmino de cinco (5) d&iacute;as h&aacute;biles. En caso que la petici&oacute;n, queja o reclamo sea respecto a uno de los clientes que se encuentran en la plataforma, AREA PRIVADA se compromete a pasar dicha petici&oacute;n, queja o reclamo al cliente correspondiente en el t&eacute;rmino de cinco (5) d&iacute;as h&aacute;biles dejando una constancia de ellos.</p>\r\n\r\n<p>Los clientes que tengan peticiones, quejas o reclamos respecto del servicio contratado por favor remitirse al correo electr&oacute;nico servicioalcliente@areaprivada.co. Dicho correo tendr&aacute; una respuesta en el t&eacute;rmino de cinco (5) d&iacute;as h&aacute;biles.</p>\r\n\r\n<p>Los Servicios, cuando se traten de Eventos o dem&aacute;s situaciones que sean de car&aacute;cter presencial, deber&aacute;n presentarse inmediatamente, el usuario acepta que dichos servicios no tienen garant&iacute;a, la garant&iacute;a est&aacute; dada, no por el resultado, sino por las condiciones de calidad en la prestaci&oacute;n del servicio, seg&uacute;n las condiciones establecidas en normas de car&aacute;cter obligatorio, en las ofrecidas o en las ordinarias y habituales del mercado.</p>\r\n\r\n<p>&nbsp;<strong><em>CONSIDERACIONES FINALES</em></strong></p>\r\n\r\n<p>&nbsp;<strong>20.&nbsp;CONTENIDOS</strong></p>\r\n\r\n<p>A trav&eacute;s de la Plataforma &Aacute;REA PRIVADA, GRUPO SYS podr&aacute; poner a disposici&oacute;n de los usuarios informaci&oacute;n de car&aacute;cter comercial y publicitario, propio o de terceros autorizado previamente de conformidad a las buenas costumbres comerciales. En estos casos GRUPO SYS no avala, ni garantiza o compromete su responsabilidad frente a los Servicios y/o Productos que se comercialicen por &eacute;stos terceros, ya que la Plataforma &Aacute;REA PRIVADA sirve como canal de comunicaci&oacute;n y publicidad, mas no como herramienta de prestaci&oacute;n de servicios y/o de productos; en consecuencia es total responsabilidad de los usuarios el acceso a los sitios que remite la publicidad, asumiendo la obligaci&oacute;n de verificar y conocer los t&eacute;rminos de los Servicios ofrecidos por los terceros.</p>\r\n\r\n<p>Toda la informaci&oacute;n puesta a disposici&oacute;n en la Plataforma &Aacute;REA PRIVADA como im&aacute;genes, publicidad, nombres, marcas, lemas y dem&aacute;s elementos de propiedad intelectual; son utilizados leg&iacute;timamente por GRUPO SYS sea porque son de su propiedad, porque tienen autorizaci&oacute;n para ponerlos a disposici&oacute;n.</p>\r\n\r\n<p><strong>21.&nbsp;FUNCIONAMIENTO DE LA PLATAFORMA &Aacute;REA PRIVADA</strong></p>\r\n\r\n<p>&nbsp;GRUPO SYS administra directamente o por medio de terceras personas la Plataforma &Aacute;REA PRIVADA, toda la informaci&oacute;n que se comunica all&iacute; corresponde a informaci&oacute;n suministrada por sus clientes, la cual por buena fe comercial se presume cierta y verificable. En ning&uacute;n caso responder&aacute; por da&ntilde;os directos o indirectos que sufra el usuario por la utilizaci&oacute;n o incapacidad de utilizaci&oacute;n de la Plataforma &Aacute;REA PRIVADA.</p>\r\n\r\n<p>&nbsp;La Plataforma &Aacute;REA PRIVADA se encuentra disponible las 24 horas del d&iacute;a para su acceso y consulta, para la realizaci&oacute;n de transacciones la disponibilidad de la Plataforma &Aacute;REA PRIVADA es de&nbsp;24 horas al d&iacute;a, sin embargo, la exhibici&oacute;n de los inmuebles se ver&aacute; reflejada en la plataforma ___ d&iacute;as despu&eacute;s de realizado el pago del plan correspondiente. GRUPO SYS realiza los mejores esfuerzos para mantener en operaci&oacute;n la Plataforma &Aacute;REA PRIVADA, pero en ning&uacute;n caso garantiza disponibilidad y continuidad permanente de la Plataforma &Aacute;REA PRIVADA.</p>\r\n\r\n<p>&nbsp;GRUPO SYS se reserva el derecho de cancelar las Cuentas de Usuarios y/o de prohibir el acceso a la Plataforma &Aacute;REA PRIVADA a los Clientes y/o Usuarios que realicen conductas violatorias de los presentes T&eacute;rminos y Condiciones o que incumplan las obligaciones contra&iacute;das o legales.</p>\r\n\r\n<p>GRUPO SYS se reserva el derecho a eliminar, suspender, limitar o impedir el acceso a su sistema o portal cuando surjan dificultades t&eacute;cnicas, o por hechos que, a su criterio, disminuyan, afecten o anulen los niveles de seguridad adoptados para el adecuado funcionamiento de dicho sistema o plataforma &Aacute;REA PRIVADA.</p>\r\n\r\n<p><strong>21. EXCLUSI&Oacute;N DE RESPONSABILIDAD </strong></p>\r\n\r\n<p>GRUPO SYS hace sus mejores esfuerzos para implementar medidas de seguridad inform&aacute;tica mediante la tercerizaci&oacute;n del servicio de hosting, no se hace responsable contractual ni extracontractualmente de las consecuencias que el uso del sitio web pueda acarrearle al usuario, incluyendo, pero sin limitarse a, acciones de virus, gusanos, caballos de Troya, hackers, spywares o da&ntilde;os en sus equipos, alteraciones en el sistema inform&aacute;tico, documentos electr&oacute;nicos o archivos del usuario.</p>\r\n\r\n<p>GRUPO SYS no se hace responsable en el caso de arriendos temporales del estado del inmueble ni de los da&ntilde;os que el arrendatario pueda incurrir durante su estad&iacute;a en el inmueble.</p>\r\n\r\n<p><strong>22.&nbsp;DERECHO DE RETRACTO</strong></p>\r\n\r\n<p>Se informa a los clientes que solicite la prestaci&oacute;n de servicios de GRUPO SYS en publicaci&oacute;n de anuncios, toma de fotograf&iacute;as y/o videos, elecci&oacute;n de un plan para exhibici&oacute;n de sus inmuebles, o cualquier otro servicio que preste actualmente o que pueda llegar a prestar la plataforma, tendr&aacute; cinco (5) d&iacute;as h&aacute;biles contados a partir de celebrado el contrato para retractarse de la transacci&oacute;n, siempre que el servicio que pretenda deshacer no haya empezado a ejecutarse.</p>\r\n\r\n<p>Verificado los supuestos para el ejercicio del derecho de retracto, GRUPO SYS dispondr&aacute; de 5 d&iacute;as h&aacute;biles para el reintegro de la totalidad del dinero que el usuario haya pagado</p>\r\n\r\n<p><strong>23.&nbsp;COMERCIO ELECTR&Oacute;NICO</strong></p>\r\n\r\n<p>En cumplimiento de las disposiciones colombianas sobre mensajes de datos seg&uacute;n la ley 527 de 1999, se comunica que la legislaci&oacute;n nacional reconoce validez a los mensajes de datos y por tanto ellos adquieren car&aacute;cter y entidad probatoria. En consecuencia, entienden los Consumidores, que mediante el cruce de mensajes de datos los intervinientes pueden dar lugar al nacimiento, modificaci&oacute;n y extinci&oacute;n de obligaciones, siendo de su resorte exclusivo el contenido, consecuencias, responsabilidades y efectos de la informaci&oacute;n generada.</p>\r\n\r\n<p>&nbsp;La transacci&oacute;n comercial que nace por este medio entre Consumidores y GRUPO SYS, es la celebraci&oacute;n de un contrato de prestaci&oacute;n de servicios por medios electr&oacute;nicos, el cual se describe en la ventana emergente que acepta el Consumidor al momento de la celebraci&oacute;n del negocio jur&iacute;dico, en ning&uacute;n momento se configura relaci&oacute;n contractual diferente como suministro, distribuci&oacute;n o dem&aacute;s similares. &nbsp;</p>\r\n\r\n<p><strong>24.&nbsp;DOMICILIO Y LEGISLACI&Oacute;N APLICABLE</strong></p>\r\n\r\n<p>&nbsp;Los presentes T&eacute;rminos y Condiciones de uso de la plataforma &Aacute;REA PRIVADA se acogen en el territorio colombiano, conforme a su Ley Aplicable. Su aceptaci&oacute;n con la utilizaci&oacute;n y creaci&oacute;n de la Cuenta de Usuario implica el ejercicio de su libre voluntad y, que la relaci&oacute;n que surge de este documento se regir&aacute; en todos sus efectos por su contenido o en su defecto por la ley comercial colombiana.</p>\r\n\r\n<p><strong>25.&nbsp;ACEPTACI&Oacute;N TOTAL DE LOS T&Eacute;RMINOS</strong></p>\r\n\r\n<p>&nbsp;El Consumidor manifiesta expresamente tener capacidad legal para usar la Plataforma &Aacute;REA PRIVADA y para celebrar las transacciones comerciales que se puedan generar con GRUPO SYS; as&iacute; mismo, manifiesta haber suministrado informaci&oacute;n real, actual, veraz y fidedigna; por ende de forma expresa e inequ&iacute;voca declara que ha le&iacute;do, que entiende y que acepta la totalidad de las situaciones reguladas en el presente escrito de T&eacute;rminos y Condiciones de uso de la Plataforma &Aacute;REA PRIVADA, por lo que se compromete al cumplimiento total de los deberes, obligaciones, acciones y omisiones aqu&iacute; expresadas.</p>\r\n\r\n<p>&nbsp;En caso que Clientes y /o usuarios de otros pa&iacute;ses utilicen la Plataforma &Aacute;REA PRIVADA se sujetan completamente a lo dispuesto en los presentes T&eacute;rminos y Condiciones.</p>\r\n\r\n<p><strong>26. TRANSGRESI&Oacute;N A ESTOS T&Eacute;RMINOS Y CONDICIONES </strong></p>\r\n\r\n<p>En caso en que el usuario no cumpla cualquiera de los t&eacute;rminos y condiciones aqu&iacute; establecidos GRUPO SYS, queda facultado para tomar las medidas legales necesarias para restablecer la situaci&oacute;n dentro de las cuales se incluye suspensi&oacute;n del acceso al Plataforma &Aacute;REA PRIVADA y/o las aplicaciones de tel&eacute;fonos celulares, prohibici&oacute;n de acceso a la misma, bloquear cualquier computador que use su direcci&oacute;n IP para poder acceder al sitio web, contactar a su proveedor de internet para bloquear el uso de esta p&aacute;gina y/o procesos judiciales por infracci&oacute;n marcaria y competencia desleal, as&iacute; como las acciones penales y de responsabilidad civil contractual y extracontractual que considere pertinentes.</p>\r\n\r\n<p>Se asume que el usuario ha le&iacute;do y aceptado los t&eacute;rminos y condiciones establecidos por GRUPO SYS, en caso de dudas, comentarios o aclaraciones en alguno de los temas tratados, por favor comunicarse con nuestra l&iacute;nea de atenci&oacute;n al cliente o v&iacute;a correo electr&oacute;nico.&nbsp;</p>\r\n\r\n<hr />\r\n<p>&nbsp;</p>\r\n\r\n<ul>\r\n</ul>',NULL,'2019-08-15 13:12:37');
